INSERT INTO animes (nombre,foto,descripcion) VALUES ('air in summer','https://cdn.jkdesu.com/assets/images/animes/image/air-in-summer.jpg','Hace mil años existió un soldado de nombre ryuuya  encargado de proteger a una chica con alas llamada Kanna. Kanna solo tenia un sueño… volver a ver a su madre,    Air in summer nos narra la historia del viaje que realizaron Kanna, ryuuya y uraha para encontrar   a la madre de Kanna, las alegrías, las aventuras,  las tristezas ,  y el trágico desenlace de esta travesía.   Si eres fan de air no te puedes perder esta ova..');
