INSERT INTO animes (nombre,foto,descripcion) VALUES ('hanbun no tsuki','https://cdn.jkdesu.com/assets/images/animes/image/hanbun-no-tsuki.jpg','Durante el invierno, Yuichi fue hospitalizado debido de su hepatitis. A pesar de eso, intentó escaparse , pero fue pillado a tiempo por el personal del hospital. Un día, conoció a Rika, una chica de su edad, del edificio de al lado. Su belleza era enorme, pero casi tanto como su egoísmo. A pesar de que lo controlaba, empezó a sentirse atraído por ella. Sin embargo, cuando Rika le contó todo sobre su enfermedad, entendió porque había actuado de esa forma. Le quedaba poco tiempo de vida.');
