INSERT INTO animes (nombre,foto,descripcion) VALUES ('dragon ball z movie 02 the worlds strongest','https://cdn.jkdesu.com/assets/images/animes/image/dragon-ball-z-movie-02-the-worlds-strongest.jpg','La situación empieza con el doctor Uiro, quien es revivido por el doctor Cochin (su compañero) con ayuda de las Dragon Balls, debido a que el primero se encontraba cautivo en el hielo de las montañas Tsumisumbri. Ya que desde hacia varios años su cerebro sobrevivía en un cuerpo robótico decidió robar el cuerpo al hombre más fuerte del mundo, pero debido a estar todos estos años encerrado en el hielo el seguía pensando que este era Kame Sen''nin. Gokū y sus amigos van al laboratorio de los doctores con el objetivo de salvar a Kame Sen''nin, y al llegar se tendrán que enfrentar contra los robots más poderosos creados por la mente ambiciosa de los científicos.');
