INSERT INTO animes (nombre,foto,descripcion) VALUES ('jigoku sensei nube','https://cdn.jkdesu.com/assets/images/animes/image/jigoku-sensei-nube.jpg','Narra las aventuras de Meisuke Nueno un maestro de la escuela primaria Dohmori, también conocido como Nube, tiene la capacidad de exorcizar demonios y espíritus gracias al poder de un poderoso demonio que encerró en su mano izquierda la cual siempre cubre con un guante negro. La historia se basa en las aventuras y travesuras de los alumnos de Nube en la escuela, su relación amorosa con la maestra Ritsuko y después con Yukime, una mujer de la nieve.');
