INSERT INTO animes (nombre,foto,descripcion) VALUES ('dotto koni chan','https://cdn.jkdesu.com/assets/images/animes/image/dotto-koni-chan.jpg','Koni chan, trata la historia de un chico gordo llamado koni, que es el ojo de adoracion de todos, el puede ser de todo, salvavidas, bombero samurai, astronauta, entre otras cosas, y tiene bastante suerte, tiene 3 amigos que son unos niños bastante raros, High un chico de pelos parados que cada que se emociona se prende en llamas, es muy tonto, y muy precoz, y siempre se quiere lucir, Nari, un niño millonario y egolatra que cree que todo lo resuelve con dinero, y es amante de todo lo que es redondo, vive en una mansion redonda, y esta enamordo de todo lo que es redondo, inclusive del mismo koni, (solo por ser redondo), y Moro, una niña alocada que se cree el simbolo sexy de la serie, es muy volada, y siempre anda queriendo mostrar su cuerpo por llamar la atencion, la serie se desarrolla en 3 episodios de 7 minutos de duracion aprox, y las historias suelen ser distintas por episodio, llena de cliches, parodias y situaciones de humor bastante bueno.');
