INSERT INTO animes (nombre,foto,descripcion) VALUES ('cowboy bebop','https://cdn.jkdesu.com/assets/images/animes/image/cowboy-bebop.jpg','En este anime, el director Shinichiro Watanabe nos narra las aventuras de Spike, Faye, Jet Black, Ed y Ein.Un grupo muy peculiar de caza-recompensas que viaja a través del sistema solar en la nave Bebop. Balas, emoción y diversión se encuentran en cada una de sus sesiones autoconclusivas, las cuales los llevarán a enfrentar a un gran adversario y viejo amigo de Spike.');
