INSERT INTO animes (nombre,foto,descripcion) VALUES ('digimon tamers','https://cdn.jkdesu.com/assets/images/animes/image/digimon-tamers.jpg','Digimon Adventure y Adventure 02 han sido para muchos niños una gran serie de anime, incluso se ha sacado un juego muy popular de cartas en Japón, uno de esos niños es Takato Matsuda, el cual sueña con tener su propio Digimon. Un día, mientras Takato juega con cartas, se encuentra con una carta azul muy extraña que jamas había visto antes, carta que luego transforma su digi-device y le permite crear su propio Digimon, junto con amigos comenzaran increíbles aventuras tanto en el mundo real como en el Digimundo.');
