INSERT INTO animes (nombre,foto,descripcion) VALUES ('argento soma','https://cdn.jkdesu.com/assets/images/animes/image/argento-soma.jpg','En el año 2059, la tierra ha sido atormentada por aliens durante varios años. En un esfuerzo de aprender más sobre estos aliens, Dr. Noguchi y su ayudantes Maki Agata y Tukuto Kenishiro tratan de revivir el experimento, un gran alien bio-mecánico llamado Frank. Durante este proceso el alien regresa a la "Vida" y el laboratorio es destruido dejando al único superviviente Takuto y el alien desaprecio en el desierto. Takuto se despierta en una cama del hospital con su vida en el caos, y su cara desfigurada. Motivado por la venganza y corazón roto, Takuto acepta una propuesta del misterioso "Sr. X" y recibe una nueva identidad como oficial alto rango de Funeral llamado Ryu Soma.');
