INSERT INTO animes (nombre,foto,descripcion) VALUES ('kimi ga nozomu eien','https://cdn.jkdesu.com/assets/images/animes/image/kimi-ga-nozomu-eien.jpg','Haruka Suzumiya una chica inteligente y algo tímida que junto a sus mejores amigos Mitsuki Hayase & Takayuki Narumi llevan una vida común y corriente como la de cualquier estudiante de preparatoria pero un suceso trágico marcará sus vidas desarrollándose una serie de situaciones complicadas y delicadas en donde nuestros sentimientos pueden confundirnos entre lo que es correcto o más importante.');
