INSERT INTO animes (nombre,foto,descripcion) VALUES ('angelic layer','https://cdn.jkdesu.com/assets/images/animes/image/angelic-layer.jpg','La historia se centra en Misaki Suzuhara que, al llegar a Tokio, donde va a vivir de ahora en adelante,  aprende lo que son "ángeles", muñecas de pequeño tamaño, comprables en las tiendas, y cuyo juego de lucha es de los más populares allí. Con la ayuda del misterioso Itchan, Misaki se inicia en el mundo de las luchas de ángeles, haciendo amistades y descubrimientos en el terreno de batalla que lograrán que lo vea como algo más que un simple juego.');
