INSERT INTO animes (nombre,foto,descripcion) VALUES ('rose of versailles','https://cdn.jkdesu.com/assets/images/animes/image/rose-of-versailles.jpg','lady oscar Criada desde su nacimiento como un varón, Lady Oscar comanda a los guardias del palacio de Versalles en los años anteriores a la Revolución Francesa. Su belleza y noble espiritu la convierten en una figura destacada ante los ojos tanto de hombres como mujeres, aunque debe luchar entre su vida de de servicio y deber al país y los impulsos de su corazón. Ella vive como un noble entre la opulencia de Versalles, sin embargo sus agudos sentidos y compasión no estan cegados a la pobreza de la gente de Francia.');
