INSERT INTO animes (nombre,foto,descripcion) VALUES ('hellsing','https://cdn.jkdesu.com/assets/images/animes/image/hellsing.jpg','Trata de que Integra Hellsing dirige a la organización Hellsing para combatir a los vampiros utilizando a un super-vampiro llamado Alucard para matar a todos los vampiros de Inglaterra. Al comienzo de la serie se une una policía que fue convertida en vampiresa por Alucard llamada Seras Victoria. Esta se niega rotundamente a beber sangre y le cuesta mucho atreverse a matar vampiros. En un principio Integra dirige Hellsing para combatir a los vampiros, pero, según como avanza la historia, se descubre a una organización dirigida por un demonio, al que llaman Incógnito, que convierte a los humanos en vampiros artificiales, y Alucard tiene que acabar con todos estos vampiros y, sobre todo, con Incógnito.');
