INSERT INTO animes (nombre,foto,descripcion) VALUES ('juuni kokuki','https://cdn.jkdesu.com/assets/images/animes/image/juuni-kokuki.jpg','La historia se centra en una joven estudiante de instituto llamada Yoko Nakajima muy respetada por sus compañeros pero con cierta aversión a enfrentarse a los problemas y carencias de autoestima. Un día de repente aparece un hombre Keiky(Un Kirin Sagrado) extraño quien le jura lealtad y la reconoce como alguien importante que puede salvar la vida de mucha gente y mas el reino de él. Después de extraños acontecimientos, se dan una serie de batallas con bestias invocadas con cierto aire a demonios mientras que el extraño personaje intenta convencer a Yoko para que lo acompañe a su tierra. Sin grandes posibilidades para negarse, Yoko y dos de sus amigos acaban recayendo en el mundo del misterioso Keiki. Su dos amigos son Yuka Sugimoto, una joven con cierto aire prepotente e Ikuya Asano, un chico algo necio y que lo unico que quiere es regresar a su hogar.');
