INSERT INTO animes (nombre,foto,descripcion) VALUES ('koi kaze','https://cdn.jkdesu.com/assets/images/animes/image/koi-kaze.jpg','Koshiro, un empleado de 27 años, acaba de ser cortado por su novia. Pocos días después, se encuentra con una estudiante que olvida su identificación en el tren, él decide entregársela, y parten por separado.  Pocos días después, la misma joven pasa en frente del lugar donde Kojiro trabaja, éste decide darle dos boletos para la feria, ya que al no tener novia, no podría utilizar, la joven decide invitarlo a él, al parque de diversiones. Poco después, su papá aparece, y resulta que la joven, Nanoka, es su hermana, a quien no veía por mas de 13 años.  Una historia de amor atípica, sencilla, delicada, un compendio de rutinas vitales en las que las vidas de Koshiro y Nanoka se entrecruzan convirtiendose en una gran serie pese a tratar una temática bastante polémica. ');
