INSERT INTO animes (nombre,foto,descripcion) VALUES ('shuffle','https://cdn.jkdesu.com/assets/images/animes/image/shuffle.jpg','Cuando se descubren dos portales en unas antiguas ruinas, la puerta a Shinaki, el reino de los Shinzoku (Dioses), y la puerta a Makai, el reino de los Mazoku (Demonios) se abren de forma irreversible. Las razas de los humanos, Shinzoku y Mazoku conviven en el mundo mortal y nada vuelve a ser lo mismo. Un día, dos nuevas familias se mudan a los lados de la casa de un joven que antes estaba viviendo una vida pacífica. En una casa vive la familia del Rey de los Dioses, mientras que en la otra vive la familia del Rey de los Demonios. Ambas familias tienen una hija cuyo deseo es vivir al lado del chico del que se enamoraron hace algunos años. Junto con el joven vive su compañera de la infancia. Mientras que estas chicas compiten por ganar su afecto, el joven encunetra que su nueva vida estara llena de celos y problemas.');
