INSERT INTO animes (nombre,foto,descripcion) VALUES ('petshop of horrors','https://cdn.jkdesu.com/assets/images/animes/image/petshop-of-horrors.jpg','En Chinatown, hay una pequeña tienda de animales que posee extraños y misteriosos animales. En esta tienda se puede obtener cualquier animal, pero antes mira bien las cláusulas del contrato, ya que si incumples alguna de ellas las consecuencias seran imprevisibles y seran solo culpa tuya.');
