INSERT INTO animes (nombre,foto,descripcion) VALUES ('nana','https://cdn.jkdesu.com/assets/images/animes/image/nana.jpg','Dos chicas de la misma edad y mismo nombre se conocieron en el tren para ir a Tokio. Sus nombres son NANA. Una de ellas es una chica que quiere ser famosa con su grupo de música y la otra quiere estar con su novio que vive en Tokio. Después de conocerse ellas deciden vivir juntas en Tokio. Komatsu Nana comienza su nueva vida en Tokio con su novio Shoji, y los amigos de allí, Junko y Kyosuke. Por otro lado, Osaki Nana se prepara para su debut como vocalista de un grupo de punk rock llamado.');
