INSERT INTO animes (nombre,foto,descripcion) VALUES ('mahou shoujo lyrical nanoha','https://cdn.jkdesu.com/assets/images/animes/image/mahou-shoujo-lyrical-nanoha.jpg','Nanoha Takamachi es una niña normal como cualquier otra, con la diferencia de que puede percibir señales de magia como ataques o barreras mágicas que la mayoría de las personas no pueden percibir siquiera. Su vida cambia drásticamente cuando se encuentra con un chico de nombre Yūno Scrya, quien le pide ayuda a Nanoha para localizar unas misteriosas gemas llamadas “Jewel Seeds”, cristales demasiado poderosos.  Normalmente, la magia va por su lado y la tecnología por el suyo, rara vez se juntan para bien, y menos en un shojo, claro que existe siempre la excepción a la regla, ese anime es Mahou Shoujo Lyrical Nanoha demostrando que los lazos de amistad perduran pese a lo difícil que pueda llegar a ser luchar por un futuro mejor. ');
