INSERT INTO animes (nombre,foto,descripcion) VALUES ('onegai teacher ova','https://cdn.jkdesu.com/assets/images/animes/image/onegai-teacher-ova.jpg','Kazami Mizuho y Kei Kusanagi por fin han logrado sacar adelante su relación, han pasado por mucho desde que se conocieron, pero finalmente su amor ha florecido como ellos esperaban, sin embargo aún tienen que afrontar su última prueba. La madre de Kazami Mizuho ha regresado, y está dispuesta a volverse la esposa de Kei. Kazami junto con su pequeña hermana, buscaran desesperadamente evitar que Kei se vuelva la pareja de su madre, sin embargo los planes de la madre de Kazami van mas allá, y ambos amantes tendrán que superar esta última prueba y así demostrar que estan hechos el uno para el otro.');
