INSERT INTO animes (nombre,foto,descripcion) VALUES ('girl meets girl','https://cdn.jkdesu.com/assets/images/animes/image/girl-meets-girl.jpg','Hazumu Osaragi, un chico tímido que fue rechazado amorosamente por Yasuna; éste decide escaparse a las montañas para curar sus penas, sin embargo una nave espacial se estrella en la montaña y este termina matándolo. Los extraterrestres reconstruyen a Hazumu, sin embargo en la reconstrucción su género fue cambiado de chico a chica. De ahí inicia una relación amorosa entre Hazumu, Yasuna y Tomari. Tomari es una amiga de infancia de Hazumu, la cual siempre ha estado enamorada de él (ahora ella)pero por ser su amiga siempre se digna en ayudarlo ocultando sus sentimientos(a ella le molesta el que Hazumu sea chica ahora), formando un triángulo amoroso con Yasuna quien esta enamorada de él.');
