INSERT INTO animes (nombre,foto,descripcion) VALUES ('maburaho','https://cdn.jkdesu.com/assets/images/animes/image/maburaho.jpg','La historia gira alrededor de Shikimori Kazuki un joven mago proveniente de familia con un bajo nivel mágico dado que el solo tiene 8 magias, pero todo cambia un día que se rebela que el es descendiente de los mejores magos del mundo, pero el poder no reside en el, sino en su hijo por medio de sus genes, es entonces cuando aparecen tres chicas hermosas Kuriko Kazetsubaki(la chica mas hermosa de la escuela, quien solo busca a Kazuki para publicidad de su empresa), Rin Kamishiro (estudiante de primero, busca restablecer el honor de su familia), y Yuuna Miyama (chica que conoció de pequeño, quien dice ser su esposa, busca el verdadero amor de Kazuki a pesar de que el no la recuerde) todas ellas a la caza de los genes de Shikimori.');
