INSERT INTO animes (nombre,foto,descripcion) VALUES ('dragon ball z movie 11 bio broly','https://cdn.jkdesu.com/assets/images/animes/image/dragon-ball-z-movie-11-bio-broly.jpg','Jagger Batta, enemigo de Mr. Satán, posee ahora el servicio del profesor Kori, que al parecer ha logrado hacer un clon de Broly.  A-18, va ha buscar el dinero que le debe Mr. Satán, encontrándose con Menmen, que intenta engañar al propio Satán.  Así que, Satán se enfrentará a otros guerreros creados por el científico.  Se dirigen a una isla y Goten y Trunks van con ellos.  Pero todo no acaba bien para Kori: Se mezclan algunos químicos de laboratorio y la isla puede reducirse a pedazos... Además, Broly parece no controlar su enorme poder y se le escapa de las manos al profesor Kori.');
