INSERT INTO animes (nombre,foto,descripcion) VALUES ('saint seiya','https://cdn.jkdesu.com/assets/images/animes/image/saint-seiya.jpg','Cuenta la historia de un grupo de jovenes guerreros denominados Santos (o caballeros en varias traducciones), quienes luchan por proteger a la diosa griega Atenea de las fuerzas del mal. Para luchar, los Santos sólo utilizan su energía interior (denominada cosmos), sus puños y armaduras que les sirven de protección y que además están inspiradas en constelaciones o seres de la mitología griega y escandinava.');
