INSERT INTO animes (nombre,foto,descripcion) VALUES ('black cat','https://cdn.jkdesu.com/assets/images/animes/image/black-cat.jpg','Una organización llamada Chronos gobierna en las sombras a gran parte de los políticos y las actividades económicas en busca del orden. Sus miembros asesinan sin piedad a todo lo que vaya mal o se oponga a ellos. La historia comienza cuando Train, conocido como Black Cat, uno de los asesinos más poderosos de la organización conoce a una extraña mujer que siempre viste un kimono llamativo y ablanda su corazón. Entonces decide no volver a recibir ordenes de nadie ni matar sin motivo y abandona la organización siendo perseguido por esta. Entonces conoce a Sven un caza-recompensas muy peculiar y comienzan a trabajar como caza-recompensas junto a él y a la niña que este cuida, una misteriosa niña con poderes sobrenaturales basados en la nanotecnología y creada artificialmente.');
