INSERT INTO animes (nombre,foto,descripcion) VALUES ('love hina again','https://cdn.jkdesu.com/assets/images/animes/image/love-hina-again.jpg','Love Hina Again es la continuación de la serie de televisión Love Hina. Consta de 3 OVAs, que se titulan como los tres protagonistas de esta parte (Kanako, Keitaro y Naru). En esta segunda entrega se puede observar la rivalidad entre Kanako Urashima y Naru Narusegawa por ser la chica de la promesa, en la cual se basa la historia del personaje principal (Keitaro Urashima).');
