INSERT INTO animes (nombre,foto,descripcion) VALUES ('mobile suit gundam seed','https://cdn.jkdesu.com/assets/images/animes/image/mobile-suit-gundam-seed.jpg','Mobile Suit Gundam SEED está ubicada en el año 71 de la Era Cósmica (EC). La trama empieza con una guerra entre la Tierra y las Colonias, similar a la "Guerra de un Año" que pudimos ver en la serie original de Gundam. Por un lado está la Alianza Terrestre y por el otro las Colonias Espaciales que conforman la Alianza Zodiacal para un Tratado de Paz (ZAFT, por sus siglas en inglés) La humanidad ha evolucionado en nuevas formas gracias a la ingeniería genética, con lo cual se ha creado un abismo entre los seres humanos normales ("Naturales") y los alterados ("Coordinadores"). Siguiendo con la tradición de la franquicia, nuevamente un joven civil que odia la guerra se encuentra pilotando un Gundam, y esta vez el héroe es un Coordinador llamado Kira Yamato. Al principio se ve obligado a luchar contra su propia gente, pero ahora se encuentra en medio de una guerra entre dos gobiernos cuyo único objetivo es el genocidio. ');
