INSERT INTO animes (nombre,foto,descripcion) VALUES ('monster','https://cdn.jkdesu.com/assets/images/animes/image/monster.jpg','Kenso Tenma, un reconocido medico cirujano de origen japonés que vive en Alemania con una gran reputación, está a punto de experimentar una historia que le cambiará la vida: en el año 1986 en Dusseldorf mientras se preparaba para operar a una personalidad que llegaba en estado crítico, una pareja de niños también llegaba al hospital; la niña se encontraba en estado de shock y el niño estaba grave con una herida de bala en la cabeza. Debatiéndose entre lo más ético y en la moral, Tenma accede a operar al niño yendo en contra de sus superiores lo que le acarrearía problemas ya que con la muerte del paciente anterior, los directivos del hospital se encargarían de arruinar su reputación. Sin embargo las cosas empeoran cuando los directivos son asesinados en extrañas circunstancias y Tenma siendo el más favorecido por estos crímenes, es señalado de ser el sospechoso. Han pasado 9 años y un fantasma de su pasado ha regresado.');
