INSERT INTO animes (nombre,foto,descripcion) VALUES ('shigetsutan tsukihime','https://cdn.jkdesu.com/assets/images/animes/image/shigetsutan-tsukihime.jpg','Shiki es un joven cuya vida está rodeada en misterio. Tras vivir 8 años con sus tíos se le permite regresar a la mansión familiar, justo después de la muerte de su padre. Con la mudanza comienza a recordar su infancia, dándose cuenta que su vida era diferente de la que creía, además su vida cambia aún más cuando conoce Arcueid, una vampiresa con la cual tiene un peculiar primer encuentro. Junto a ella, sin que le quede opción, tiene que ayudarla en su cacería nocturna por eliminar a una raza de vampiros malignos.');
