INSERT INTO animes (nombre,foto,descripcion) VALUES ('loveless','https://cdn.jkdesu.com/assets/images/animes/image/loveless.jpg','Ritsuka es un chico (12 años) que no cree en la buena fe ni la amistad sincera de las personas, sufrió la perdida de la persona mas querida en su vida y sufre el maltrato de su madre. Soubi es un joven de 21 años,estudiante de dibujo que conoció al hermano de ritsuka y ahora se presenta ante el prometiéndole entregarle su cuerpo y hasta su vida, además de decirle que peleara por el robándole su primer beso.Asi comenzaran a aparecer enemigo contra los que Soubi y Ritsuka tendrán que combatir.');
