INSERT INTO animes (nombre,foto,descripcion) VALUES ('peach girl','https://cdn.jkdesu.com/assets/images/animes/image/peach-girl.jpg','Momo es una chica de piel morena que anteriormente formo parte del equipo de natación de su escuela. Por el aspecto de su piel los chicos la toman por mujer fácil. Ella esta enamorada en secreto de Touji, el chico serio de la clase a quien también le gusta Momo pero que no se atreve a decirlo,pero lo demuestra defendiéndola de los demás chicos de la escuela. Por azares del destino aparece en escena Okayazu, el chico popular de la escuela quien desde que Momo lo salvo de morir ahogado ha vivido enamorado de ella y que por error le roba su primer beso. A travez del anime, Momo va descubriendo que siente mas por Okayasu de lo que ella pensaba y pronto ella tiene que decidir con cual de los dos chicos quiere vivir su historia de amor');
