INSERT INTO animes (nombre,foto,descripcion) VALUES ('tylor el capitan irresponsable','https://cdn.jkdesu.com/assets/images/animes/image/tylor-el-capitan-irresponsable.jpg','La tierra se encuentra en guerra con el imperio Laalgon, Justy Ueki Taylor es un chico tranquilo, con sus 20 años y su grado de teniente comandante se dio maña a fuerza de su increible poder de convencimiento para transformase en el capitan de la nave Brisa (Soyokaze). A pesar de que su tripulación, y a decir verdad nadie, ve con buenos ojos su nuevo cargo, Taylor comienza a lograr meritos, a pesar de que todos lo que logro, según el, es gracias a la suerte. Poco a poco nos damos cuenta de que este aparente holgazan, es más inteligente de lo que parece.');
