INSERT INTO animes (nombre,foto,descripcion) VALUES ('eyeshield 21','https://cdn.jkdesu.com/assets/images/animes/image/eyeshield-21.jpg','Producido al anime por Studio Gallop NAS.Todo comienza cuando el protagonista de la historia Sena Kobayaka, que es el típico chico del que otras personas abusan y es maltratado por los demás, esconde una gran e increíble habilidad para jugar al Fútbol Americano. Al principio Sena por sugerencia de Mamori decide entrar a algún club para ya no ser el mismo perdedor que era además de ya no depender tanto de la ayuda de su amiga  y por coincidencia cae al club de fútbol americano que en un principio Sena no quería entrar por ser violento, pero al ver el gran entusiasmo y convicción de Kurita uno de los integrantes del equipo acepta.Al final todos querrán ganar en el mejor de los torneos donde se desenvuelve esta magnifica serie que es el Chrismas Bowl.');
