INSERT INTO animes (nombre,foto,descripcion) VALUES ('alps no shoujo heidi','https://cdn.jkdesu.com/assets/images/animes/image/alps-no-shoujo-heidi.jpg','Después de quedarse huérfana, Heidi se ve obligada a vivir con su abuelo, que vive en los Alpes. Ella se entera de que es un hombre muy amargado que sólo acepta acogerla a la fuerza. Pero la bondad de Heidi puede abrirle el corazón. Junto con el pastor Peter y la inválida Clara, tiene muchas aventuras.');
