INSERT INTO animes (nombre,foto,descripcion) VALUES ('ninja scroll','https://cdn.jkdesu.com/assets/images/animes/image/ninja-scroll.jpg','El filme está basado en una época real del Japón feudal, la acción transcurre después de las guerras civiles, cuando el clan de Ieyasu Tokugawa derrota al clan de Hideyoshi Toyotomi en la batalla de Sekigahara. Es aquí donde el autor entonces introduce lo fantástico de la historia: aparece un misterioso ninja de nombre Genmma seguido por un ejército de poderosos guerreros con técnicas increíbles y sobrenaturales llamados demonios Kimón. Esta amenaza es supuestamente liderada por el "Shogun de las Tinieblas", el cual mas adelante se conoce que es el mismo Genmma resucitado luego que años atrás, en su anterior vida, fuese derrotado y decapitado en una batalla por Jubei, uno de los protagonistas principales.');
