INSERT INTO animes (nombre,foto,descripcion) VALUES ('get backers','https://cdn.jkdesu.com/assets/images/animes/image/get-backers.jpg','Se trata de un par de chicos extraños llamados Ginji Amano o "Emperador relámpago" y Ban Midou, los cuales tienen una organización llamada "Get Backers", que garantizan recuperar cualquier cosa con una tasa del 100% de efectividad. Aún cuando parecen ser muchachos comunes y corrientes, poseen unos extraños poderes sobrehumanos, pero también sentimientos nobles, los cuales, aunque siempre tengan mala suerte con el dinero, les ayuda a tener aliados de su parte. Gracias a sus habilidades, siempre cumplen con su misión de recuperación.');
