INSERT INTO animes (nombre,foto,descripcion) VALUES ('kousetsu hyaku monogatari','https://cdn.jkdesu.com/assets/images/animes/image/kousetsu-hyaku-monogatari.jpg','La historia transcurre en la Era Bakumatsu, cuando los cimientos del gobierno de Tokugawa empezaron a tambalearse. En la edad donde la "Oscuridad" se respiraba y la presencia de monstruos era muy temida, un escritor soñador, Yamaoka Hyakusuke, viaja por todos los países con la esperanza de publicar en todo el mundo su obra "Hyaku Monogatari". En el camino, se encontrará con criminales como Mataichi del Sufrimiento, Ogin de los Muñecos o Chouji de la LLamada de los Pájaros. Son una banda criminal secreta, contratada para resolver casos que son enterrados en la oscuridad. Buscando al criminal, usando hábiles estratagemas, juzgarán el ego humano y cerrarán un caso tras otro, siempre acompañados por un sonido de campanas y la palabra "Go Koui Tatemasaru" (que significa "yo lo haré", en un japonés antiguo y refinado)');
