INSERT INTO animes (nombre,foto,descripcion) VALUES ('fist of the north star','https://cdn.jkdesu.com/assets/images/animes/image/fist-of-the-north-star.jpg','Después de la Tercera Guerra Mundial, el planeta se volvió un lugar desolado, y el agua se convirtió en el recurso más apetecido por las personas alrededor del mundo. Ya no es la inteligencia ni la habilidad es lo que reina en este mundo, sino que la fuerza, específicamente, la fuerza bruta. Es por eso que son los más fuertes los que dominan el mundo. Esto cambiará cuando El Puño de la Estrella Del Norte llegue a esas tierras, este personaje, descendiente de la más fuerte Arte Marcial nunca conocida, se encarga de ayudar a los pobladores a conseguir una vida más digna.');
