INSERT INTO animes (nombre,foto,descripcion) VALUES ('tenjou tenge','https://cdn.jkdesu.com/assets/images/animes/image/tenjou-tenge.jpg','ichiro Nagi y Bob Makihara son dos estudiantes que han tomado el control de 99 colegios a través de sus puños, escogiendo la academia Tōdō como la número 100, pero se encuentran con que en este lugar hay personas mucho más fuertes que ellos. Esto se debe a que Tōdō fue fundada con el propósito de convertirse en un lugar donde mantener vivas las artes marciales de antaño. Ellos se encuentran con Maya Natsume, quien es la capitana del último club que se interpone ante el control total del Consejo Disciplinario, el Club Jūken. Cada año los diferentes grupos pelean por el control de la escuela, aunque antes de empezar, ya el Consejo Disciplinario ha empezado a destruir a sus opositores.');
