INSERT INTO animes (nombre,foto,descripcion) VALUES ('karekano','https://cdn.jkdesu.com/assets/images/animes/image/karekano.jpg','Después de ser reconocida a lo largo de toda su camino escolar, Yukino Miyazawa ha llegado a la escuela preparatoria Hokuei para seguir con su trayectoria de  perfección y ejemplo de una estudiante brillante, hermosa y humilde. A pesar de que, en su hogar empobrecido,  es una adolescente egoísta, vaga y caprichosa reconoce que su comportamiento en la escuela es una gran farsa.  Empezado el año Yukino Miyazawa vera que tiene la competencia de un rival, Sōichirō Arima, apuesto joven hijo de una familia rica que logra tener exelentes calificaciones. A causa de ese motivo Yukino Miyazawa dedicara todo su esfuerzo a superarlo. Tras pasado un tiempo, Sōichirō Arima descubre la realidad detras de la protagonista y comienzan de esta forma una historia de amistad y amor en la que los sentimientos se encuentran muy involucrados.');
