INSERT INTO animes (nombre,foto,descripcion) VALUES ('tsubasa chronicle','https://cdn.jkdesu.com/assets/images/animes/image/tsubasa-chronicle.jpg','Sakura es la princesa del país de Clow, reinado por su hermano Touya. Su mejor amigo es Syaoran, un joven arqueólogo. Un día, una presencia misteriosa llama a Sakura hacia unas ruinas, donde unas alas crecen en su espalda. Syaoran consigue rescatarla, pero sus alas se transforman en plumas que son esparcidas a través de distintas dimensiones. Entonces, es revelado que las alas eran la manifestación del alma y las memorias de Sakura y que sin ellas morirá. Así que Syaoran visita a Yuuko, la bruja dimensional,y junto al guerrero Kurogane y el mago Fye, consigue el poder para poder cruzar dimensiones al azar a cambio de los bienes más preciados de los tres: la espada de Kurogane, el tatuaje de Fye y los recuerdos de la relación de Sakura y Syaoran. Yuuko entonces les entrega a una pequeña criatura blanca llamada Mokona, quien les permite visitar otros mundos y así poder recuperar las plumas de Sakura.');
