INSERT INTO animes (nombre,foto,descripcion) VALUES ('hunter x hunter greed island','https://cdn.jkdesu.com/assets/images/animes/image/hunter-x-hunter-greed-island.jpg','Es la OVA que continua a la del Genei Ryodan Durante esta parte Gon Y Killua siguiendo una pista que dejo el padre de Gon, se logran enrolar en el juego Greed Island (la isla de la ambición). Al colocarse en frente de la consola son transportados a un territorio el la cual ellos creen en un principio es una realidad virtual, pero que es en realidad una isla la cual ha sido modificada por muchos cazadores gracias a la habilidad especial (NEN) que ellos poseen, siendo el padre de Gon uno de lo creadores del Juego. Durante sus aventuras en el Juego conocen a Biske, quien a pesar de poseer una apariencia juvenil, es en relidad una adulta mayor y quien se convierte en su próxima Maestra. Durante sus aventuras en Greed Island, Gon y Killua se encuentran con Hisoka. Aunque también ingresan otros miembros del Ryodan (Saga anterior) estos no entran en contacto con ellos, ya que están buscando una solución para liberar a sus jefe de la cadena que le incrusto Kurapica.');
