INSERT INTO animes (nombre,foto,descripcion) VALUES ('magic knight rayearth','https://cdn.jkdesu.com/assets/images/animes/image/magic-knight-rayearth.jpg','Hikaru, Umi y Fuu se encuentran en la Torre Tokyo por una excursión escolar, pero misteriosamente son transportadas a un mundo extraño, donde los rezos del pilar se transforman en el poder que sostiene el mundo. Tras encontrarse con el mago más poderoso de Cefiro, Guru Clef, este les entrega poderes con los que se convertirán en las legndarias Guerreras Mágicas y así rescatar a la princesa Esmeralda, raptada por el sacerdote Zagato, y salvar Cefiro, ya que si la princesa no puede rezar, Cefiro se destruirá.');
