INSERT INTO animes (nombre,foto,descripcion) VALUES ('the heroic legend of arslan','https://cdn.jkdesu.com/assets/images/animes/image/the-heroic-legend-of-arslan.jpg','Esta es la historia de los viajes del Príncipe Arislan, el heredero al imperio de Palse. Al principio, Palse y los Lusitanos están en guerra. Mediante la traición, el Reino de Palse cae derrotado por los Lusitanos. El Rey es capturado junto a la hermosa Reina. Arislan, sin embargo, quedó solo y bajo la custodia del Caballero de Plata, que le jura fidelidad. Junto con otros amigos y aliados, Arislan consigue reunir un gran ejército listo para reclamar su reino. Con el valor de Farangese, una sacerdotisa guerrera que puede hablar con el alma, Gieve, el tranquilo y tramposo juglar, Daryoon, el gran guerrero, Narsus, el maestro de la táctica y la estrategia, su viaje está a punto de comenzar. Con tales aliados,Arislan comienza a obtener victoria tras victoria, pero su compasión y buen corazón no lo convierten en enemigo de los Lusitanos, sino que piensan que podría ser el Rey que siempre soñaron... ');
