INSERT INTO animes (nombre,foto,descripcion) VALUES ('karas','https://cdn.jkdesu.com/assets/images/animes/image/karas.jpg','Karas   es una animacion de seis partes de henshin, del genero tipo superheroe japones.  Karas trata de la historia de Otoha, un yakuza, viviendo en una versión ficticia de Shinjuku, Tokyo, ciudad poblada por humanos y yōkai (Espirítus Japoneses). Otoha, es uno de los karas, humanos superpoderosos que actuan como agentes de la tierra y  también se puede transformar en un vehiculo, avión y en un tanke blindado.  Otoha siendo un karas, es un hábil espadachín que intenta detener a su corrupto predecesor,  de tomar Tokyo. Entre otros personajes se encuentran: Nue, el yōkai; y Homura, la karas de otra ciudad, ellos ayudan a Otoha en su misión. La serie tambíen contiene una historia paralela que se enfoca en como los humanos son afectados por las actuaciones de Eko.');
