INSERT INTO animes (nombre,foto,descripcion) VALUES ('trigun','https://cdn.jkdesu.com/assets/images/animes/image/trigun.jpg','Trigun narra la historia de Vash La Estampida, también conocido como El Huracán Humano, y de las dos empleadas de la Sociedad de Seguros Bernardi: Meryl Stryfe y Milly Thompson, que tienen la misión de seguir y minimizar los efectos de los desastres que parecen perseguir a Vash a donde quiera que vaya. Éste parece tener una doble personalidad, alternando entre el idiota inofensivo y el guerrero implacable, pero es siempre un pacifista acérrimo e imparable.');
