INSERT INTO animes (nombre,foto,descripcion) VALUES ('full moon wo sagashite','https://cdn.jkdesu.com/assets/images/animes/image/full-moon-wo-sagashite.jpg','Mitsuki es una chica que tiene 12 años. Vive con su abuela y padece de un tumor maligno en su laringe. Cuando era pequeña, hizo una promesa con el chico que más le gustaba (Eichi) y se dijeron que ella seria una cantante y él un astrónomo. Ellos dos fueron separados; Eichi se fue a América y así Mitsuki quiere hacerse famosa para que Eichi la vea y así se puedan reunir de nuevo. Mitsuki se entera de un cásting que hacen en su ciudad en busca de una estrella juvenil, pero a causa de su enfermedad, su abuela no la deja cantar ya que esto sólo la empeoraría. Mientras estaba en casa se le aparecen dos guardianes de la muerte (Shinigamis), llamados Meroko y Takuto, ellos han venido con la misión evitar cualquier circunstancia que pudiera hacerla morir antes de tiempo. Por alguna extraña razón, ella los puede ver y aunado a esto, se les escapa que dentro de un año morirá a causa de su enfermedad, así que Mitsuki decide escaparse de casa.');
