INSERT INTO animes (nombre,foto,descripcion) VALUES ('sailor moon','https://cdn.jkdesu.com/assets/images/animes/image/sailor-moon.jpg','Serena Tsukino es una chica comun, tiene 14 años y asiste a segundo de secundaria. Siempre llega tarde a clase, olvida los deberes, duerme mucho y come demasiado; pero su vida cambia cuando una gata negra muy peculiar se presenta ante ella para desvelarle su misión: ella es una guerrera de la Luna, Sailor Moon, destinada a luchar por el amor y la justicia. Y no es la única, pronto aparecerían otras chicas, Sailor Scouts, con quienes entablara una amistad de toda la vida. Al lado de ellas y de Tuxedo Mask (su salvador emergente) deberán vencer a la Reina Beril del Negaverso y descubrir importantes señales de un pasado milenario.');
