INSERT INTO animes (nombre,foto,descripcion) VALUES ('paranoia agent','https://cdn.jkdesu.com/assets/images/animes/image/paranoia-agent.jpg','Un fenómeno social está ocurriendo en Tokyo, que es causado por un asesino serial juvenil a quien llaman "El chico del bate".Él golpea a la gente para pder "ayudarlos", siempre es gente con problemas a la que no le gusta su vida y al final esta gente termina muriendo a causa del chico del bate. La historia gira principalmente alrededor de los detectives que están tras de él y sus víctimas, contando sus vidas privadas y como terminan siendo "salvados" por el chico del bate.');
