INSERT INTO animes (nombre,foto,descripcion) VALUES ('gundam wing','https://cdn.jkdesu.com/assets/images/animes/image/gundam-wing.jpg','En el año 195 después de la creación de las colonias la alianza unida de la esfera terrestre gana poder militar y conquista colonia tras colonia cinco jóvenes fueron enviados a la tierra para contrarrestar este poder militar con la ayuda de sus máquinas llamadas Gundams los cuales se son lo mobile suits mas poderosos creados según los creadores de los mismos en el camino los cinco pilotos encontraran situaciones para ganar esta guerra entre la alianza de la tierra y las colonias espaciales.');
