INSERT INTO animes (nombre,foto,descripcion) VALUES ('pokemon advance','https://cdn.jkdesu.com/assets/images/animes/image/pokemon-advance.jpg','Despues de participar en la Liga Johto, Ash decide comenzar de nuevo en otro viaje, esta vez por sí mismo y Pikachu, en la tierra de Hoenn. A pesar de que no es el único por mucho tiempo, como 10 años de edad, de mayo (a quien no le gusta Pokemon, pero solo quiere venir a ver el mundo) viaja con el despues de Pikachu destruye su bicicleta. Ash también se encuentra con su antiguo compañero, Brock, y el hermano menor de May, Max. Juntos, viajan a lo largo de Hoenn, luchando contra líderes de la gimnasia, concursos que entran, y otros eventos en el camino hacia la Liga Hoenn.');
