INSERT INTO animes (nombre,foto,descripcion) VALUES ('shakugan no shana','https://cdn.jkdesu.com/assets/images/animes/image/shakugan-no-shana.jpg','Sakai Yuuji, estudiante de secundaria del instituto Misaki, quien llevaba una vida normal, se ve en serios aprietos cuando se ve atrapado en una batalla contra un "Guze no Tomogara", seres devoradores de almas, sin embargo es salvado dramáticamente por una "Neblina de Llama" llamada "La cazadora de ojos y pelo ardientes" que le cambia por completo su vida cuando el chico se entera que ya había muerto… su "yo" ya había sido devorado, que él era una "antorcha", los restos de su alma, y que iba a desaparecer sin dejar rastro. En ese momento entabla una complicada relación con aquella chica a quien él osadamente llamó Shana. Ella se ve obligada a proteger al chico cuando se enteran que éste es un "Mistes", una "antorcha" única que encierra un tesoro en su interior, de ahí comienza una difícil batalla contra los "Guze no Tomogara" por proteger el tesoro que carga Yuuji y la ciudad en la que todos viven de una devastación casi inminente, mientras tanto Shana no sabe como arreglárselas para encajar en la vida del estudiante de secundaria.');
INSERT INTO series (id_anime,estado) VALUES (66,False);
