INSERT INTO animes (nombre,foto,descripcion) VALUES ('ray the animation','https://cdn.jkdesu.com/assets/images/animes/image/ray-the-animation.jpg','Después de un pasado terrible Rei (Ray) Kasugano se ha dedicado a salvar las vidas a otros sin cobrar. Trabaja como un médico y debido a las habilidades especiales puede ver a una persona dentro, haciéndola muy bueno en su trabajo. Cuando trabaja con un amigo suyo y colaborador en la oficina, Shinoyama trabaja en casa para crear las maneras rápidas de salvar vidas al mismo tiempo que ella. Ray, Shinoyama y su colaborador miran hacia muchos obstáculos para salvar estas vidas pero trabajan en conjunto para hacerlo.');
