INSERT INTO animes (nombre,foto,descripcion) VALUES ('ai yori aoshi','https://cdn.jkdesu.com/assets/images/animes/image/ai-yori-aoshi.jpg','Kaoru Hanabishi es un estudiante universitario de segundo año, de la Universidad de Meiritsu, en Tokyo. Acostumbrado a gozar de una vida tranquila, rutinaria, y además solitaria. Sin embargo, su rutina se ve afectada cuando en una estación del metro conoce a una desorientada y bella señorita, que llega a Tokio para visitar a una persona muy especial para ella, un antiguo amigo de su infancia. Al verla tan desorientada, Kaoru le ofrece su ayuda para encontrar la dirección, sin embargo la dirección corresponde a un sitio deshabitado. La bella chica comienza a llorar, al mismo tiempo que empieza a llover. Luego, Kaoru lleva a la bella chica hasta su casa para esperar hasta que termine la lluvia, luego de ver que el gran esfuerzo de esta chica ha sido inútil.La invita a tomar el te sin saber que la señorita es nada menos que Aoi Sakuraba, una antigua amiga de su infancia, y que la persona a la que buscaba era nada menos que él.');
