INSERT INTO animes (nombre,foto,descripcion) VALUES ('last exile','https://cdn.jkdesu.com/assets/images/animes/image/last-exile.jpg','Claus y Lavie son amigos huerfanos unidos porque sus padres murieron, viajeros de un Vanship (dejado por sus padres) para entregar correos. En una Entrega se encontraran a una pequeña niña de 8 años llamada Alvis, que tienen que llevar al reconocido y grande nave de Combate El Silvana, Claus y Lavie por su parte se quedaran en el Silvana protegiendo a Alvis mientras que Claus combatira en el Cile con los Vanships de batallas para así poder recuperar el cielo.');
