INSERT INTO animes (nombre,foto,descripcion) VALUES ('one piece taose kaizoku ganzack','https://cdn.jkdesu.com/assets/images/animes/image/one-piece-taose-kaizoku-ganzack.jpg','Esta OVA data de 1998, por lo que los personajes que aparecen son Luffy, Zoro y Nami. La trama ocurre cronológicamente después de la batalla con Buggy, comenzando con Luffy y los demás en el bote siendo atacados por un monstruo marino. Tras esto llegan a una isla gobernada por un pirata llamado Ganzack, a quien tienen que vencer para liberar un pueblo.   Este ova no tiene las voces que se usan en la serie porque la hicieron antes de la serie para ver la respuesta del público al anime.');
