INSERT INTO animes (nombre,foto,descripcion) VALUES ('medabots','https://cdn.jkdesu.com/assets/images/animes/image/medabots.jpg','Del siglo XXII, un niño llamado Ikki Tenrio, con su amigo Medabee que participan en Robottallas. Se trata sobre las peleas de un robot contra otro. Ikki y sus amigos debe enfrentar varios obstaculos como detener los planes de la Pandilla de RubberRobo.');
