INSERT INTO animes (nombre,foto,descripcion) VALUES ('mobile suit victory gundam','https://cdn.jkdesu.com/assets/images/animes/image/mobile-suit-victory-gundam.jpg','Es el año 0153 del Universal Century. La Federación Terrestre ha colapsado y no tiene fuerzas para controlar todos los territorios de la Esfera Terrestre. El Imperior Zarnscare de las colonias espaciales de Side 1, comienza una invasión a gran escala para tomar el control del planeta. Pero grupos rebeldes en la Tierra, se oponen a Zarnscare, y luchan fieramente para dar tiemrpo a la Federación para que recupere sus fuerzas y lance un contraataque.  El Grupo Camión es uno de estos grupos rebeldes, quienes poseen una poderosa y sectrta arma, el Victory Gundam. Uso Evin, un niño audaz, pero poco interesado en la guerra, debe pilotar el V Gundam cuando las batallas alcanzan su preciada región de Kasarelia. Uso y sus amigos, comienzan un viaje que los llevará a conocer la maldad que alcanza el ser humano, cuando está cegado por la codicia. ');
