INSERT INTO animes (nombre,foto,descripcion) VALUES ('basilisk kouga ninpou chou','https://cdn.jkdesu.com/assets/images/animes/image/basilisk-kouga-ninpou-chou.jpg','Basilisk, considerada una de las mejores series del genero ninja, nos narra la historia de dos clanes ninja separados por el odio entre dos familias. Los actuales representantes, Kouga Danjo del clan Kouga y Ogen del clan Iga, buscaron afanosamente fraguar su amor y con ello poner fin a la larga historia de odio entre ambos clanes, sin embargo, oscuros sucesos acontecieron impiendo la unión de su amor. Años después, el Shogun decide reunir a las familias que pudiecen darle un sucesor, para elegirlo decide hacer una competencia entre los clanes encargados de proteger a su posible sucesor, el ganador será aquel cuyo clan logre eliminar a los doce miembros del clan rival, sin embargo, la historia de amor acostecida hace mucho tiempo parece volver a repetirse con los nuevos representantes de los clanes Kouga e Iga, podra superar su amor el produndo odio entre sus clanes?.');
