INSERT INTO animes (nombre,foto,descripcion) VALUES ('blood','https://cdn.jkdesu.com/assets/images/animes/image/blood.jpg','Saya es una estudiante que lleva una vida tranquila con su familia, con una excepción: ella no recuerda nada acerca de su vida anterior al último año. Un día, un inesperado evento transforma su pacífica vida en una aventura caótica. Un apuesto músico que viste de negro se aparece ante ella, su nombre es Hagi(pronunciado:hatgi). En el momento en que pone en sus manos una katana, la historia comienza un nuevo curso.');
