INSERT INTO animes (nombre,foto,descripcion) VALUES ('gulliver boy','https://cdn.jkdesu.com/assets/images/animes/image/gulliver-boy.jpg','Gulliver es un mago travieso que debió permanecer encerrado en la escuela de magia Yudo. Al tiempo decidió escapar y volver a su tierra. Pero al llegar se dio cuenta que toda su gente estaba siendo atacada por el Rey Jugo de Hispania, y no pudo controlar su dolor cuando supo que había matado a su padre. Desde ese momento ambos se buscarán, Gulliver para vengar la muerte de su padre y el rey de hispania para matarlo como una forma de remediar su error.');
