INSERT INTO animes (nombre,foto,descripcion) VALUES ('dear boys','https://cdn.jkdesu.com/assets/images/animes/image/dear-boys.jpg','En la escuela secundaria Mizuho, el equipo de baloncesto esta en problemas, ya que no hay suficientes jugadores para jugar baloncesto, sólo eran 4. Ademas, el entrenador los ha dejado despues de un conflicto con Fujiwara. Sin embargo,la llegada de Kazuhiko Aikawa logra influir en los otro 4 miembros para completar el equipo y comenzar a jugar. A pesar de que hay sólo son cinco, logran obtener la ayuda de la entrenadora del equipo femenino para dirigirlos. En un primer momento, ella parece muy estricta, pero luego revela su apego a sus "Queridos muchachos". Juntos, hacen todo lo posible para hacer sus sueños realidad.');
