INSERT INTO animes (nombre,foto,descripcion) VALUES ('girls bravo 2','https://cdn.jkdesu.com/assets/images/animes/image/girls-bravo-2.jpg','Yukinari es un estudiante de instituto que siempre había sido rechazado por las chicas por ser de baja estatura, y al final acabó por ser "alérgico" a las mujeres, cuando las tocaba, era como si tocase una ortiga. Un día tras volver del instituto, se coló por el desague de la bañera y llegó a "Siren", un sitio en el que sólo había mujeres. Preocupado por su "alergia", intentó volver a la Tierra.');
