INSERT INTO animes (nombre,foto,descripcion) VALUES ('amaenaideyo','https://cdn.jkdesu.com/assets/images/animes/image/amaenaideyo.jpg','Satonaka Ikko es un aprendiz de sacerdote budista el cual es enviado al Templo de Saien, a la cabeza del cual está su propia abuela, Jotoku. Lo que le espera allí es un duro entrenamiento, trabajos de purificación y seis monjas. Aunque el vivir con monjas de su misma edad pueda parecer envidiable, en la práctica le tratan como al chico de los recados, Â¡y su habilidad para la purificación no puede compararse con la suya! Sin embargo, cuando los deseos mundanos se apoderan de él su poder se multiplica.');
