INSERT INTO animes (nombre,foto,descripcion) VALUES ('saber marionette j again','https://cdn.jkdesu.com/assets/images/animes/image/saber-marionette-j-again.jpg','Lime, Cherry, y Bloodberry, androides con forma femenina llamados Marionettes, han regresado a Otaru. La razon es la reforma de las Marionettes de Faust (Tiger, Luchs y Panther), que han sido enviadas con Otaru y sus amigos para aprender mas sobre los humanos. La introduccion de una septima Marionette llamada Marine, la cual tiene un misterioso poder -y todos ellos poseen el circuito especial que les permite tener emociones humanas!!');
