INSERT INTO animes (nombre,foto,descripcion) VALUES ('shinigami no ballad','https://cdn.jkdesu.com/assets/images/animes/image/shinigami-no-ballad.jpg','Momo es una Shinigami, una diosa de la muerte. Su trabajo es llevarse las almas de los vivos cuando éstos mueren. Es un trabajo duro ya que se tiene que enfrentar a situaciones muy duras y a historias muy complicadas donde no siempre es justo hacer lo que debe, aunque siempre intente ayudar a los demás. Daniel la culpa de ser una llorona, a lo cual ella siempre responde: Los muertos no pueden llorar, asi que yo lloro por ellos. Pero es una Shinigami y su obligación es llevarse a los vivos.');
