INSERT INTO animes (nombre,foto,descripcion) VALUES ('grappler baki tv','https://cdn.jkdesu.com/assets/images/animes/image/grappler-baki-tv.jpg','Baki Hanma es un joven luchador que anhela seguir los pasos de su padre, Yujiro, y convertirse en el luchador más fuerte del mundo. A través de eso, entrena incansablemente y lucha constantemente para perfeccionar sus habilidades y desarrollar su cuerpo para lograr estos objetivos. Muchas batallas intensas se adelantan a Baki mientras se dirige a su búsqueda para ser el mejor y, en última instancia, obtener el título de "Rey" de su padre.');
