INSERT INTO animes (nombre,foto,descripcion) VALUES ('yugioh duel monsters gx','https://cdn.jkdesu.com/assets/images/animes/image/yugioh-duel-monsters-gx.jpg','Yu-Gi-Oh! GX cuenta la historia de Judai Yuki, un chico normal que ingresa en la Academia de Duelos fundada por Seto Kaiba. Una vez allí, Judai conoce a Syrus Truesdale y a Chumley Huffington, quienes a partir de entonces se convierten en sus amigos inseparables. Para poder ganar el derecho de estar en la academia, Judai, como había llegado tarde había tenido que enfrentarse con Vellian Crowler, y una vez que lo hubo vencido había quedado en el dormitorio Slifer Rojo, el cual es para los duelistas más débiles. El Ra Amarillo para los prometedores y el Obelisk Blue es para los estudiantes privilegiados. Más tarde, Judai tiene que enfrentarse a numerosos oponentes con ayuda de sus amigos para poder salvar al mundo de la destrucción.');
