INSERT INTO animes (nombre,foto,descripcion) VALUES ('devilman lady','https://cdn.jkdesu.com/assets/images/animes/image/devilman-lady.jpg','La historia se centra en Jun Fudo, una maestra que es atacada por los demonios mientras acompañaba a un grupo de estudiantes en un viaje escolar. En medio del asalto, junio se transforma en Devil Lady y defiende a los sobrevivientes del ataque inicial, matando a los demonios con su recien adquirida fuerza. Jun, ahora la Devilman Lady, lucha por el bien de la humanidad para protegerlos de las bestias del diablo y sus creaciones.');
