INSERT INTO animes (nombre,foto,descripcion) VALUES ('my neighbor totoro','https://cdn.jkdesu.com/assets/images/animes/image/my-neighbor-totoro.jpg','La película es un retrato de la vida rural japonesa en los años cincuenta. Un profesor universitario se muda junto a sus dos hijas a una casa cerca de un bosque mientras su mujer se recupera de tuberculosis en un sanatorio rural. Sus hijas descubren la existencia de los "conejillos de polvo", de este modo aprenden que hay seres que no todos pueden ver, como los espíritus del bosque, solamente aquellos de corazón puro. Mei, de cuatro años de edad, resulta fascinada al encontrar dos pequeños espíritus y se determina a encontrar al rey del bosque, Totoro.');
