INSERT INTO animes (nombre,foto,descripcion) VALUES ('kujibiki unbalance','https://cdn.jkdesu.com/assets/images/animes/image/kujibiki-unbalance.jpg','Chihiro Enamoto es la protagonista de la serie, es una estudiante del prestigioso colegio de secundaria Rikkyoin. En este Instituto, se compite anualmente para ser miembro del consejo estudiantil. Para ello se hacen grupos y se compite a través de pruebas físicas y mentales (competiciones en la cocina, de natación, pruebas extremas de calor y frío, incluso una puesta en escena en situación de guerra). El trabajo en equipo y cooperación es fundamental para ganar.');
