INSERT INTO animes (nombre,foto,descripcion) VALUES ('rurouni kenshin tsuiokuhen','https://cdn.jkdesu.com/assets/images/animes/image/rurouni-kenshin-tsuiokuhen.jpg','Un joven niño llamado Shinta es salvado por Hiko Seijuro y dado el nombre de Kenshin. Él entrena a Kenshin en el camino de Hiten Mitsurugi Ryuu, una técnica de espada sin rival. Como la guerra civil se intensifica, el joven Kenshin siente que su deber es ayudar a salvar personas. Lo que hace convertirse en el más temido Hitokiri Battousai.');
