INSERT INTO animes (nombre,foto,descripcion) VALUES ('paradise kiss','https://cdn.jkdesu.com/assets/images/animes/image/paradise-kiss.jpg','Yukari desea  hacer a sus padres felices estudiando duro y entrando en un buen colegio. Una tarde, sin embargo, ella es raptada por un grupo de diseñadores de propio estilo llamados  así mismos "Paradise Kiss". Yukari se encuentra de repente dentro de la vida de montaña rusa del mundo de la moda, guiada por George, un extraordinario y talentoso diseñador de moda. En un maquillaje encantador de cuerpo, la mente y el alma, ella es convertida de una chica sencilla en una modelo exclusiva de ropa.');
