INSERT INTO animes (nombre,foto,descripcion) VALUES ('ginban kaleidoscope','https://cdn.jkdesu.com/assets/images/animes/image/ginban-kaleidoscope.jpg','La serie se enfoca en una chica de 16 años llamada Tasuza Sakurano que practica patinaje artístico sobre hielo y que es candidata para ir a las Olimpiadas como representante de Japón. Tazusa se cae durante una presentación en Montreal, Canadá y pierde el conocimiento. Al mismo tiempo, un piloto de acrobacias canadiense de 16 años llamado Pete Pumps muere cuando su avión se estrella en medio de una presentación. Poco tiempo después de despertar, Tazusa se da cuenta de que está escuchando una voz que le dice que es un fantasma llamado Pete y que tiene que habitar su cuerpo por 100 días.');
