INSERT INTO animes (nombre,foto,descripcion) VALUES ('elfen lied','https://cdn.jkdesu.com/assets/images/animes/image/elfen-lied.jpg','Elfen Lied es un anime dirigido por Mamoru Kanbe basado en el manga del mismo nombre creado por Lynn Okamoto. Nos cuenta la historia de los diclonius, la siguiente mutación o evolución del homosapiens. Tiene escenas de desnudos, gore, violencia física y psicológica.  La historia se basa especialmente en el personaje de Lucy/Nyuu, una diclonius abandonada por sus padres humanos al nacer, y despreciada constantemente gracias a sus cuernos por los demás humanos. Esto la lleva a despreciar y matar a cuanto ser no-diclonius encuentre, hasta que conoce a Kōta, un humano, y la vida de ambos cambia para siempre.');
