INSERT INTO animes (nombre,foto,descripcion) VALUES ('bleach memories in the rain','https://cdn.jkdesu.com/assets/images/animes/image/bleach-memories-in-the-rain.jpg','Bleach - Memories in the Rain: Es la primera OVA de Bleach. Se emitió en el Jump Festa 2004 Anime Tour (exposición anual donde se publican materiales inéditos sobre diversas series) y luego se llevó a DVD. Transcurre entre los capítulos 8 y 9 del anime. Se centra principalmente en los sentimientos de Ichigo en relación a la muerte de su madre y es una versión modificada del mismo episodio.');
