INSERT INTO animes (nombre,foto,descripcion) VALUES ('futari ecchi','https://cdn.jkdesu.com/assets/images/animes/image/futari-ecchi.jpg','Makoto y Yura tienen 25 años y son marido y mujer. Lo malo de su matrimonio es que estaba ya pactado. Sin embargo, ellos deciden repetir todo el proceso romántico desde el principio, desde la primera cita hasta la primera noche. Pero el problema es que Yura es "vírgen" y Makoto es un "pipiolo" a sus 25 años... Ninguno de los dos tiene experiencia en "ya sabéis qué", así que Makoto y Yura deciden resolver su problema a toda costa... ');
