INSERT INTO animes (nombre,foto,descripcion) VALUES ('air gear','https://cdn.jkdesu.com/assets/images/animes/image/air-gear.jpg','Dispositivos implantados en los rollers que poseen la potencia del motor de un auto eso son los air trecks. Permiten  asombrosas acrobacias y llevan a los deportes extremos a nuevos niveles. Retos, competencias y hasta combates son posibles con ellos. Ikki tras descubrir y robar los air trecks de su hermana comenzara una nueva vida llena de adrenalina aventuras combates y retos. Será capaz de alcanzar el sendero de las alas.');
