INSERT INTO animes (nombre,foto,descripcion) VALUES ('saint seiya saga de hades sanctuary','https://cdn.jkdesu.com/assets/images/animes/image/saint-seiya-saga-de-hades-sanctuary.jpg','Luego de la derrota de Poseidón todo se encontraba en calma en el santuario, de pronto un sello misterioso es roto y Dohko anuncia que una nueva guerra santa ha comenzado. Los caballeros de bronce Seiya, Shiryu, Hyoga, Shun e Ikki deben vestir sus armaduras nuevamente en otra encrucijada, esta ves contra el dios de la muerte, Hades.');
