INSERT INTO animes (nombre,foto,descripcion) VALUES ('dragon ball z movie 01 the deadzone','https://cdn.jkdesu.com/assets/images/animes/image/dragon-ball-z-movie-01-the-deadzone.jpg','Hace muchos siglos, Kamisama compitió con Garlic para ser el sucesor del Dios de la Tierra. Éste les pidió que expulsaran la maldad de sus espíritus, y Kamisama fue el único que lo logró; irritado, Garlic se rebeló contra Dios, pero fue desterrado. Ahora su hijo, Garlic Jr., quien ha vuelto para vengarse, decide reunir las esferas del dragón para desear ser inmortal. Por el camino, secuestra Gohan, y tiene la intención de convertirlo en su discípulo.');
