INSERT INTO animes (nombre,foto,descripcion) VALUES ('saber marionette j to x','https://cdn.jkdesu.com/assets/images/animes/image/saber-marionette-j-to-x.jpg','Ocurre después de Saber Marionette J Again y cuenta la historia de Otaru y sus marionettes aunque se torna más dramática que las otras series de la saga J. En esta serie las marionettes expresan su profundo deseo de ser humanas. También se muestra la vida en Japoness después que Gartland se convirtiera en el país democrático de Germania. Pero entre tanta paz surge de nuevo Gartland, pero liderado por un nuevo Fausto, clonado por el Doctor Hess para cumplir sus planes. Después de la derrota de Gartland, el doctor Hess se va a Xi''An donde empezará la odisea de Otaru y sus tres marionettes hasta el descenlace final de la serie.');
