INSERT INTO animes (nombre,foto,descripcion) VALUES ('soukyuu no fafner right of left','https://cdn.jkdesu.com/assets/images/animes/image/soukyuu-no-fafner-right-of-left.jpg','Yumi Ikoma y Ryou Masaoka son niños que han sido seleccionadas para participar en una mision de alto secreto, para ser los pilotos de las primeras unidades de combate Fafner; la ultima oportunidad para la supervivencia de la raza humana. El enemigo es despiadado, implacable y es capaz de leer la mente de los seres humanos. Por lo tanto, los detalles de esta mision se mantienen en secreto, incluso desde el personal involucrado. Los jovenes pilotos deben usar todo su valor y fe para sobrevivir y completar su mision y el destino de la humanidad se veria comprometida.');
