INSERT INTO animes (nombre,foto,descripcion) VALUES ('sousei no aquarion','https://cdn.jkdesu.com/assets/images/animes/image/sousei-no-aquarion.jpg','La Humanidad perdió dos terceras partes de su población debido a un desastre natural: el hielo del continente Antártico se derritió y apareció la Atlántida, la civilización desaparecida hace 12.000 años. Debido a esto, revivieron los Ángeles Caídos, una raza de seres alados que envian unas armas biomecánicas conocidas como Bestias Míticas a las ciudades para capturar a la gente y extraer la energía biológica Prana. Los humanos excavaban en las profundidades del océano para encontrar las Máquinas Vectoriales (Vectores), unas armas que se decía que eran capaces de vencer a los Ángeles Caídos. Estas máquinas se combinan y forman el Ángel Aquarion Mecánico. Para pilotar el Aquarion hace falta una persona con la habilidad Elemento compatible con el sistema; por eso se reunió a adolescentes candidatos a ser pilotos. Por fin, llegó el día en el que el Ángel Aquarion Mecánico apareció. ');
