INSERT INTO animes (nombre,foto,descripcion) VALUES ('mahou shoujo lyrical nanoha as','https://cdn.jkdesu.com/assets/images/animes/image/mahou-shoujo-lyrical-nanoha-as.jpg','Han pasado 6 meses desde el incidente con Precia Testarossa. Nanoha Takamachi lleva viviendo una vida normal como cualquier niña de su edad aunque de vez en cuando practica algo de magia. Chrono ahora forma parte de la tripulación del Asura. Arf y Fate por su parte, están a la espera del veredicto de su juicio por haber participado en la busqueda de las Jewel Seeds aunque mantienen contacto con Nanoha vía e-mail. Las cosas parecen marchar en paz cuando repentinamente Nanoha es atacada de súbito por una extraña niña que se hace llamar Vita y que pertenece a un grupo llamado "Wolkenritter" que custodian un misterioso libro llamado "el libro de la oscuridad" el cual se alimenta con magia al usar los "Linker Cores" de los magos como alimento para llenar sus páginas las cuales están en blanco y que dotará de poderes destructivos a quien lo posea. Una nueva batalla comienza y Nanoha en esta oportunidad no estará sola. ');
