INSERT INTO animes (nombre,foto,descripcion) VALUES ('xxxholic','https://cdn.jkdesu.com/assets/images/animes/image/xxxholic.jpg','El protagonista de la serie es Kimihiro Watanuki, un estudiante de instituto que está constantemente asediado por monstruos, fantasmas y espíritus que se sienten atraídos mágicamente hacia él. Estos monstruos son invisibles para las personas sin poderes, por lo que los demás lo tachan de extraño o loco cuando es asediado por los espíritus. Todo cambia cuando entra en una tienda en la que venden deseos. La tienda pertenece a la atractiva Yūko Ichihara,una poderosa bruja del Japón actual. Ofrece a Watanuki la posibilidad de que deje de ver los fantasmas y criaturas si paga un precio de igual valor que la energía que ella requiere para realizar dicha labor. Watanuki al vivir solo, pues sus padres murieron en un accidente muchos años atrás, no tiene dinero,pero Yuko le ofrece encargarse de las labores domésticas de la tienda así como del ocasional trabajo extra, hasta haber trabajado lo suficiente para concederle su deseo.');
