INSERT INTO animes (nombre,foto,descripcion) VALUES ('ueki no housoku','https://cdn.jkdesu.com/assets/images/animes/image/ueki-no-housoku.jpg','Ueki no Housoku; Ueki Kosuke un estudiante de secundaria tiene una extraña habilidad: puede convertir cualquier cosa que él considere basura en un árbol. Esta habilidad le fue concedida por su tutor, un hombre llamado Kobayashi. Ueki intenta mantener esta habilidad en secreto hasta que un dia su compañera de clase, Hori Ai, lo descubre. Al principio Hori lo seguía para descubrir su verdadera personalidad, pero comenzó a ayudarle cuando vió los sacrificios que debía hacer para usar su talento...');
