INSERT INTO animes (nombre,foto,descripcion) VALUES ('ushio to tora ova','https://cdn.jkdesu.com/assets/images/animes/image/ushio-to-tora-ova.jpg','Ushio es un joven que no cree ni una pizca de las historias de monstruos que le cuenta su papá, una de ellas dice que en el templo de su casa se halla un Youkai empalado desde hace 500 años por la Lanza de la Subyugación del Mal. Mientras Ushio curoseaba entre las cosas del templo, encuentra un extraño sótano donde yace aquel youkai del que le hablaba su padre. ');
