INSERT INTO animes (nombre,foto,descripcion) VALUES ('gun x sword','https://cdn.jkdesu.com/assets/images/animes/image/gun-x-sword.jpg','El protagonista, Vann, viaja a través del mundo buscando al Hombre de la garra metálica, quien asesinó a su novia. En su viaje se une a varios viajeros quienes persiguen al mismo asesino. El mundo donde se desarrolla Gun × Sword es el Planeta de las ilusiones sin fin, donde hay personajes diversos. Este planeta posee una luna que lo orbita y posee una tecnología similar a la Tierra, con una pequeñas excepciones, como algunos trajes de combates llamados ''Armaduras''. Se parece a un pueblo del viejo oeste, en donde existe una falta de ley en las áreas más rurales y en las grandes planicies.');
