INSERT INTO animes (nombre,foto,descripcion) VALUES ('higurashi no naku koro ni','https://cdn.jkdesu.com/assets/images/animes/image/higurashi-no-naku-koro-ni.jpg','La serie nos ubica en 1983 en un pequeño pueblo llamdo Hinamizawa, donde Keiichi se ha mudado hace apenas un mes, pero su adaptación ha sido rápida, su vida es tranquila y ya tiene amigas con los que pasarlo bien y divertirse. Pero este apacible pueblo tiene una oscura leyenda de asesinatos macabros, maldiciones y cultos a una antigua deidad que poco a poco se irá apoderando de Keiichi haciéndolo cruzar la delgada línea entre lo real y lo irreal, sumergiéndolo en la locura y el miedo.');
