INSERT INTO animes (nombre,foto,descripcion) VALUES ('hellsing ultimate','https://cdn.jkdesu.com/assets/images/animes/image/hellsing-ultimate.jpg','Hellsing es una organización que se dedica a detener a los malvados que acechan en la oscuridad, los vampiros. También se encargan de otros monstruos de la noche y los matan. La organización existe hace mucho tiempo y su liderazgo ha ido pasando de padres a hijos durante siglos. Sin embargo, hoy en día, la jefa actual de la organización encontró algo muy importante, su arma mas mortal y poderosa, el inmortal vampiro, Alucard, que esta sometido a la organización por sellos restrictivos y obedece las ordenes de cada uno de los lideres de la familia a lo largo de los siglos.');
