INSERT INTO animes (nombre,foto,descripcion) VALUES ('el viaje de chihiro','https://cdn.jkdesu.com/assets/images/animes/image/el-viaje-de-chihiro.jpg','Se trata de Chihiro, quien con sus padres se mudan a vivir a otra cuidad, aunque ella no esta de acuerdo con dicha decision.  Al no encontrar el camino correcto a casa, se pierden en un bosque misterioso; llegan al final del camino y se encuentran de frente a un tunel.  Al llegar al otro lado del tunel encuentran un pueblito deshabitado pero con muchos restaurantes, al no encontrarse nadie, sus padres deciden empezar a comer y pagar luego. Al ponerse el sol se convierten en cerdos. Ahora Chihiro tienen que hacer lo imposible para hacer que sus padres vuelven a la normalidad y asi llevarselos de vuelta a casa.');
