INSERT INTO animes (nombre,foto,descripcion) VALUES ('mushishi','https://cdn.jkdesu.com/assets/images/animes/image/mushishi.jpg','Guinko ,el personaje principal, es una de esas personas que conoce a los Mushi ,que no son ni plantas ni animales; son distintos a otras formas de vida como los microorganismos y hongos. Por su efímera naturaleza, su existencia y apariencia son desconocidas para la mayoría excepto para un número limitado de humanos que poseen la habilidad de verlos e interactuar con ellos. El es un amo de Mushi (Mushi master, 蟲師, mushi-shi), que viaja para investigar y conocer más a estos seres. En el camino, ayudará a gente que tiene problemas con ciertos sucesos paranormales relacionados con los Mushi.');
