INSERT INTO animes (nombre,foto,descripcion) VALUES ('lupin iii','https://cdn.jkdesu.com/assets/images/animes/image/lupin-iii.jpg','Lupin III es el sucesor de una familia de ladrones (Arsenio Lupin y Arsenio Lupin II), quien está empeñado en realizar espectaculares robos. Para ello cuenta con dos colaboradores, Oscar y Francis, que son un pistolero profesional y un guerrero samurai respectivamente. También se une a ellos en ocasiones esporádicas, y siempre por intereses personales, el amor platónico de Lupin... Patricia. Es una auténtica maestra del engaño, y muchas veces hará perder la cabeza e incluso arriesgar su vida a Lupin.  A esto debe añadirse la intervención del Inspector Basilio, de la Interpol, que perseguirá a Lupin en todos y cada uno de sus actos, pero nunca logra detenerlo. ¿O si? ');
