INSERT INTO animes (nombre,foto,descripcion) VALUES ('yu gi oh duel monsters','https://cdn.jkdesu.com/assets/images/animes/image/yu-gi-oh-duel-monsters.jpg','Yu-Gi-Oh (Significa Rey de los Juegos), Su personaje principal Yugi Muto en compañía de sus mejores amigos Katsuya Jonouchi (Joseph Wheeler), Anzu Mazaki (Tea Gardner), y Hiroto Honda (Tristán Taylor), pero también tiene la compañía de un espíritu de un Antiguo Faraón "Atem"; tienen aventuras que están estrechamente ligadas a un juego de cartas "Duelo de Monstruos", un juego ligado con el pasado de egipto el cual se jugaba en tiempos antiguos y que es descubierto por Pegasus J. Crawford (maximilian Pegasus), este es el creador de el Juego "Duelo de Monstruos" tomando como base lo que paso en egipto hace mucho tiempo. Del juego se crean torneos y campeonatos nacionales e internacionales, participando Yugi Mūtō obteniendo el titulo de "Rey de los Juegos". Yugi Mūtō y su contraparte el Antiguo Faraón "Atem" se enfrentan a muchas vicisitudes ocasionadas por enemigos en su mayoia del pasado de el faraon, teniendo el faron con la ayuda de Yugi la labor de detenerlos.');
