INSERT INTO animes (nombre,foto,descripcion) VALUES ('detective conan','https://cdn.jkdesu.com/assets/images/animes/image/detective-conan.jpg','boby jackson a sus 17 años es el mejor detective del mundo, ayuda siempre a la policia en sus casos, pero en uno de esos casos al espiar lo que hacian unos misteriosos hombres de negros, lo descubren y le hacen beber una pastilla que debia matarlo , pero le hizo rejuvenecer a sus 8 años.');
