INSERT INTO animes (nombre,foto,descripcion) VALUES ('gankutsuou el conde de montecristo','https://cdn.jkdesu.com/assets/images/animes/image/gankutsuou-el-conde-de-montecristo.jpg','Gankutsuou: El Conde de Montecristo ,es una serie de anime, basada en la novela del dramaturgo francés Alejandro Dumas, El conde de Montecristo. Gankutsuou se destaca por presentar una animacion distinta al promedio, con manejo avanzado del Layering y el uso del 3D. Esto para dar un cierto realce a la animacion. Gankutsuou se ubica en el año 5053, por lo cual mezcla elementos del siglo XIX de la novela con alta tecnología, viajes espaciales y el uso de mechas. Cada capítulo tiene una introduccion en frances.  Mientras visitaba el festival de Luna, el Vizconde Albert de Morcerf y el Barón Franz d Epinay conocen al Conde de Monte Cristo, un noble. Cuando se van, el Conde promete visitar a Albert en París. Tras llegar, se insinua en las famílias más poderosas de Francia (los Morcerf, los Danglars y los Villefort).');
