INSERT INTO animes (nombre,foto,descripcion) VALUES ('aozora shoujotai','https://cdn.jkdesu.com/assets/images/animes/image/aozora-shoujotai.jpg','Cuando el mecánico de aviación (y anime fanboy) Takuya Isurugi se transfiere al 801o Escuadrón de Entrenamiento Táctico, parece que recibe más de lo que esperaba. Capitaneado por el rudo y veterano Mitsuru Konishi, los "Airbats" son  un grupo de chicas a cual ma sexy, son 4 chicas cuando dos de los pilotos, Miyuki Haneda y Arisa Mitaka, se enamoran de la Isurugi sorprendido.  Esto inflama-ya su rivalidad existente, lo que causa problemas para su cooperación en el aire.  Isurugi debe de persuadirlas a las chicas para que colaboren  en equipo. Ya que la JASDF (siglas de la fuerzas areas de defensa de japón) esta ya considerando la disolución de su unidad, Isurugi debe persuadir a las niñas a trabajar juntos para mejorar su desempeño y salvar al equipo. es una gran serie');
