INSERT INTO animes (nombre,foto,descripcion) VALUES ('cinderella boy','https://cdn.jkdesu.com/assets/images/animes/image/cinderella-boy.jpg','Este anime cuenta las aventuras del detective Ranma Hinamatsuri y su compañera Rella "Cindy" Shirayuki. Ambos sufren un accidente automovilístico, pero un desconocido científico les salvó la vida. Ahora, sin saberlo, ambos viven en un mismo cuerpo, en el que se turnan involutariamente cada media noche, y cuando despiertan, se encuentran en situaciones en las que lo/a dejo su compañero/a.');
