INSERT INTO animes (nombre,foto,descripcion) VALUES ('naruto takigakure no shitou ore ga eiyuu dattebayo','https://cdn.jkdesu.com/assets/images/animes/image/naruto-takigakure-no-shitou-ore-ga-eiyuu-dattebayo.jpg','Después de escoltar a salvo al cobarde líder de Takigakure, Shibuki, a su tierra natal, Naruto Uzumaki, Sasuke Uchiha y Sakura Haruno se sorprenden por la repentina invasión de ninjas rebeldes en la aldea. Como su maestro Kakashi Hatake se había ido a Konoha de antemano, el equipo debe lidiar con las fuerzas atacantes por su cuenta.  Mientras el grupo se prepara para una operación de rescate, se enteran de que Suien, la mente maestra detrás del asalto, está persiguiendo un elixir que aumenta brevemente el chakra de quienes lo beben diez veces. Sabiendo que el líquido está en posesión de Shibuki, Suien toma a los aldeanos como rehenes para usarlos como moneda de cambio.');
