INSERT INTO animes (nombre,foto,descripcion) VALUES ('jojos bizarre adventures','https://cdn.jkdesu.com/assets/images/animes/image/jojos-bizarre-adventures.jpg','Basado en el manga de Hirohiko Araki, la primera serie de OVAS sigue a Josef Joestar y su nieto de 17 años Jotaro, mientras ellos intentan acabar con el inmortal vampiro Dio. Joseph y Jotaro han reunido varios guerreros místicos cada uno con poderes, representando las cartas de Stand (Una variación de las cartas del Tarot), con Jotaro teniendo poderes sobre el más poderoso Stand (el Star Platinum). El propio Dio ha reunido guerreros Stand y juntos a ellos luchará por el destino de la madre de Jotaro (Holly) y la dominación del mundo.');
