INSERT INTO animes (nombre,foto,descripcion) VALUES ('furi kuri flcl','https://cdn.jkdesu.com/assets/images/animes/image/furi-kuri-flcl.jpg','Naota Nandaba es un joven que vive una vida completamente normal y aburrida, todos los días se reúne con Mamimi Samejima la ex-novia de su hermano Tasuku quien se fue a Estados Unidos para jugar Baseball.  Pero todo esto cambia una vez Haruko Haruhara entra en su vida y la normalidad y aburrimiento es sustituida por extraños eventos que involucran a su familia, amistades y su ciudad además de los constantes ataques por parte de robots que salen de su cabeza.');
