INSERT INTO animes (nombre,foto,descripcion) VALUES ('abenobashi mahou shoutengai','https://cdn.jkdesu.com/assets/images/animes/image/abenobashi-mahou-shoutengai.jpg','Arumi y Sasshi viven su ultimo verano juntos en el distrito comercial Abenobashi, ya que la familia de Arumi se trasladara a otra ciudad. Sin embargo su abuelo sufre un accidente a raiz del cual tanto Arumi como Sasshi son transportados a un Abenobashi alternativo donde todo es posible y lo absurdo y la parodia estan a la orden del dia. Podran volver sanos y salvos a su hogar.');
