INSERT INTO animes (nombre,foto,descripcion) VALUES ('orphen','https://cdn.jkdesu.com/assets/images/animes/image/orphen.jpg','Orphen, un hechicero renegado, abandona todo, por amor a Azali, ex-compañera hechicera de Orphen. Tras un experimento fallido de Azali con la Espada de Baltanders, se convierte en un gigante dragón llamado Agosto Sangriento. Aunque tiene forma de monstruo, Azali conserva su mente dentro de su nuevo cuerpo, y trata de revertir el hechizo fallido, a su manera, claro esta. Orphen, quien estuvo presente en este experimento fallido, la ve irse lejos de la Torre de los Colmillos (lugar de entrenamiento para hechiceros), y tras enterarse que la Torre planea matar a Agosto Sangriento,en vez de retornarla a su estado original, decide irse de ese lugar, y buscar como retornar a su amada Azali a su cuerpo original. En su viaje lo acompaña Magic, aprendiz de Orphen, y Cleo, dueña de la Espada de Baltanders. Dos hermanos (Dojin y Volkan) siguen a este grupo. Volkan odia a Orphen, ya que le pidio dinero prestado, y aun no lo devuelve.');
