INSERT INTO animes (nombre,foto,descripcion) VALUES ('majutsushi orphen revenge','https://cdn.jkdesu.com/assets/images/animes/image/majutsushi-orphen-revenge.jpg','El viaje de Orphen un hechicero negro ex miembro de la famosa torre del colmillo cuna de grandes hechiceros continúa, y Cleo y Magic su pandilla a la que se une otra chica llamada Licorice, que está empeñada en que nombren a Orphen "Hechicero Real". Mientras tanto, Flamesoul intenta vengarse de Orphen y les envía diversos monstruos que irán interponiéndose en su camino. ¿Qué se esconde en el pasado de Licorice? ¿Y en el de Orphen? Poco a poco las dudas se irán despejando mientras nuestros amigos siguen adelante...');
