INSERT INTO animes (nombre,foto,descripcion) VALUES ('rec','https://cdn.jkdesu.com/assets/images/animes/image/rec.jpg','La historia narra las dificultades por las que pasa Onda Aka (aprendiz de actriz de doblaje) y Matsumaru Fumihiko un hombre común y corriente que trabaja como publicista en una empresa de comida.  Ambos se conocen por casualidad, y después de un incidente desagradable para Onda Matsumaru decide que viviran juntos; a partir de ese momento sus vidas cambian totalmente ya que ninguno de los dos antes había tenido algo de éxito en su vida profesional y es a partir de aquí que empiezan a ver la vida de otro modo, pero eso si, nadie puede descubrir que ambos viven juntos bajo el mismo techo.');
