INSERT INTO animes (nombre,foto,descripcion) VALUES ('onegai teacher','https://cdn.jkdesu.com/assets/images/animes/image/onegai-teacher.jpg','Mizuho Kazami, es una hermosa mujer que va a la escuela de un pueblo a enseñar Japonés. Pero en realidad es una representante de la asociación galáctica con la misión de observar la Tierra. Accidentalmente, Kei Kusanagi, uno de sus estudiantes, descubre su verdadera identidad. Para mantener el secreto a salvo, Mizuho se casa con Kei y comienzan a vivir juntos. Podran mantener el secreto a salvo y que los compañeros de clase de Kei no descubran el matrimonio.');
