INSERT INTO animes (nombre,foto,descripcion) VALUES ('hunter x hunter ryodan','https://cdn.jkdesu.com/assets/images/animes/image/hunter-x-hunter-ryodan.jpg','El Grupo de Ladrones y Asesinos "Genei Ryodan" proviene de la ciudad de las Estrellas Fugaces, esta ciudad está fuera de toda jurisdicción, es por eso que en este lugar no hay leyes ni reglas. La mafia y esta ciudad poseían una estrecha relación colaborando unos a otros. Pero el Genei Ryodan rompió este lazo y arrasó con las principales cabezas de la mafia. El Genei Ryodan también llamado "La Araña" consta de una cabeza y doce patas, la cabeza es el líder de la Araña, llamado Kuroro Lucifer, le siguen las doce patas que son: (lista de los integrantes del Ryodan según la fuerza de cada uno) Ubogin, Phinx, Hysoka, Franklin, Feitan , Machi, Kuroro, Bonorenolf, Nobunaga, Shalnark, Pakunoda, Shizuku y Kurotopi.');
