INSERT INTO animes (nombre,foto,descripcion) VALUES ('tenshi na konamaiki','https://cdn.jkdesu.com/assets/images/animes/image/tenshi-na-konamaiki.jpg','Megumi es una muchacha llena de contrastes: es la mas femenina alla donde va llevandose de calle los hombres por su belleza y su aspecto angelical, sin embargo pesa sobre ella una maldicion. En el pasado, cuando tenia tan solo nueve años, un genio sellado en un libro magico que le regalo un brujo, la convirtio del niño que era en una niña debido a que el deseo que formulo “quiero ser el hombre mas hombre”, fue invertido y le hizo “la mujer más mujer”, es decir la más femenina y bella. Por si no fuera poco, solamente su amiga Miki que ha sido su compañera desde la infancia, sabe acerca de esta situacion ya que estaba junto a ella cuando sucedio la broma-maldicion del genio. Nadie mas sabe acerca de ello, todo recuerdo de su pasado como niño fue borrado en todas partes: de la memoria, fotografias, etc.');
