INSERT INTO animes (nombre,foto,descripcion) VALUES ('slayers','https://cdn.jkdesu.com/assets/images/animes/image/slayers.jpg','Lina Inverse la hechicera conocida como "la asesina de ladrones" ataca una guarida de ladrones a quienes roba todos sus tesoros,camino a la aldea que solía ser presa de los ladrones es atacada por unos bandidos pero antes de que usase sus poderes mágicos para mandarlos al infierno es rescatada por un joven espadachín llamado Gaudi quien se une a ella en su aventura, durante su viaje serán atacados por un sin fin de demonios, hechiceros y bandidos que quieren recuperar la estatua de orialcon que robo a los bandidos, conocerán al increíble Rezo el monje rojo y se enfrentaran al mismo rey demonio. Sin duda una vida de aventuras.');
