INSERT INTO animes (nombre,foto,descripcion) VALUES ('shaman king','https://cdn.jkdesu.com/assets/images/animes/image/shaman-king.jpg','Una noche de vuelta a casa, Manta Oyamada decide pasar por el cementerio para acortar camino. Es allí donde conoce a Yoh Asakura, un chico de su edad que se presenta como un Shaman, el nexo entre este mundo y el otro. Manta, tras descubrir que puede ver a los espíritus de los muertos, se va corriendo y gritando. Sin embargo, al otro día, llega un chico nuevo a su clase que resulta ser el mismísimo Yoh. A partir de ahi, la historia se desarrolla sobre el Torneo de Shamanes que se hace cada 500 años para elegir al Shaman King.');
