INSERT INTO animes (nombre,foto,descripcion) VALUES ('tales of phantasia ovas','https://cdn.jkdesu.com/assets/images/animes/image/tales-of-phantasia-ovas.jpg','Basadas en el RPGs original de SNES, estas cuatro OVAs narran la historia de Cless, Mint y Chester, cuyo mundo se encuentra en peligro debido a la resurrección del Dios del Mal, Dhaos. Ellos lucharán en una batalla más allá del tiempo junto a Arche y Klarth (procedentes del pasado y poseedores de la extinguida magia en la línea temporal de Cless y el resto) y Suzu (una ninja del futuro que busca venganza contra Dhaos). Juntos emprenderán un viaje para conocer los ocultos motivos e intenciones de Dhaos y acabar de una vez por todas con él.');
