INSERT INTO animes (nombre,foto,descripcion) VALUES ('midori no hibi','https://cdn.jkdesu.com/assets/images/animes/image/midori-no-hibi.jpg','Midori no Hibi es una serie de fantasía, comedia y romance basada en el manga de Kazurou Inoue con el mismo nombre. A lo largo de los 13 episodios de ésta serie se desarrolla la historia de Seiji Sawamura cuya mano derecha se transforma en una pequeña niña llamada Midori Kasugano que está enamorada de él. Seiji procurará esconder lo que ahora es su mano derecha y buscar una forma de que ambos regresen a la normalidad, pues su meta en la vida es conseguirse una novia (todos le tienen miedo por ser un "bravucón"); mientras que midori no lo dejará en paz de lo feliz que se siente al estar con él, ya que antes de convertirse en una mano era muy tímida y solo podía esconder el amor hacia Seiji desde lejos. Todo lo que sucede se vuelve muy problemático, sin embargo pasan por muchas aventuras, gracias a las que pronto se darán cuenta de que no solo llevan la relación de un muchacho y su mano.');
