INSERT INTO animes (nombre,foto,descripcion) VALUES ('bakuretsu tenshi','https://cdn.jkdesu.com/assets/images/animes/image/bakuretsu-tenshi.jpg','Año 20XX. Tokyo se ha vuelto un lugar post-apocalíptico, donde se vive en un infierno -literalmente-. La serie inicia con Kyohei Tachibana, un estudiante de cocina, quien encuentra trabajo como cocinero con un par de mercenarias sexy que viven en un trailer, y sus aventuras mientras intentan descubrir una serie de atentados que suceden en la ciudad de Tokyo.');
