INSERT INTO animes (nombre,foto,descripcion) VALUES ('ghost sweeper gs mikami','https://cdn.jkdesu.com/assets/images/animes/image/ghost-sweeper-gs-mikami.jpg','El sobredesarrollo y la sobrepoblación que comenzó a aquejar a Japón forzó a muchos espíritus y fantasmas en pena tuvieran que abandonar sus hogares de manera forzada, lo que sin duda los ha alterado y quieren hacer notar su enojo. De esta manera fue creada una nueva profesión, la de los cazafantasmas: exorcistas de espíritus malignos que trabajaban por contrato, generalmente de millones de yens. Pero entre todos hay sólo una que es conocida como el mejor, una muchacha llamada Reiko Mikami, quien antes había sido aprendiz del Padre Karasu. Mikami es la reina entre los cazafantasmas, pero su defecto es que ama el dinero más que ninguna otra cosa en el mundo, sin importarle los sentimientos.  Parte del equipo de Mikami son Tadao Yokoshima, un joven estudiante de preparatoria fanático de la pornografía, y Okinu, el fantasma de una joven menor de 20 años que antes fuera el espíritu de una montaña por más de 300 años.');
