INSERT INTO animes (nombre,foto,descripcion) VALUES ('solty rei','https://cdn.jkdesu.com/assets/images/animes/image/solty-rei.jpg','Roy Revant está viviendo la dura vida de un cazarrecompensas en una ciudad donde miles de personas murieron 12 años atrás por un fenómeno llamado "La catástrofe". Dicho fenómeno causó grandes estragos en la ciudad y es la causa de que miles de personas usen implantes.  Roy Revant está buscando a su hija desaparecida durante "La catástrofe", y cuando parece que sólo un milagro podría ayudarle en dicha tarea aparece Solty que literalmente cae del cielo. Solty es una reensamblada única en su tipo. Es una joven sin pasado que encontrará una familia en un mundo lleno de dolor y alienación.');
