INSERT INTO animes (nombre,foto,descripcion) VALUES ('aishiteruze baby','https://cdn.jkdesu.com/assets/images/animes/image/aishiteruze-baby.jpg','Aishiteruze baby es una serie shojo que gira en torno a la vida de Kippei Katakura, es un chico muy popular de secundaria que coquetea con cualquier chica que vé, sin pensar en sus sentimientos. Su vida se transforma cuando un día, su tía pone en su mandato a su prima Yuzuyu quien tiene cinco años de edad. Kippei se le asigna la tarea de ocuparse de Yuzuyu por el momento, y él debe aprender a convertirse en la "madre” que necesita. Como Kippei aprende a cuidar de Yuzuyu, también aprende a cuidar de Kokoro, una tranquila chica en su escuela, que ella también cuida de el. El final del manga podría ser un buen fin, pues Kokoro le sigue siendo fiel a Kippei lo que significa que se podrían casar en un futuro cercano.');
