INSERT INTO animes (nombre,foto,descripcion) VALUES ('hana yori dango','https://cdn.jkdesu.com/assets/images/animes/image/hana-yori-dango.jpg','Tsukushi Makino tiene 16 años y es de clase trabajadora. Gracias al esfuerzo monetario de sus padres, consigue entrar en la Eitoku, un instituto en el cual estudian los hijos de las familias más adineradas de todo Japón. No consigue adaptarse del todo y su única intención es pasar desapercibida, todo cambia en el momento que se cruza en el camino de los F4, cuatro chicos que dominan la escuela, y comienzan a hacerle la vida imposible, pero ella les demostrará que no es tan fácil atormentar a "la mala hierba".');
