INSERT INTO animes (nombre,foto,descripcion) VALUES ('jikuu tenshou nazca','https://cdn.jkdesu.com/assets/images/animes/image/jikuu-tenshou-nazca.jpg','Hace 500 años, una sangrienta guerra civil estalló en el imperio Inca. El bando perdedor decidió utilizar un arma mística de asombroso poder que casi destruye toda la tierra. En la actualidad, en Japón, Kyoji Miura descubre que es el alma reencarnada del antiguo guerrero Inca. Pero Kyoji no está solo. Su amigo y profesor, Tate, es también un alma Inca reencarnada. Pero Tate decide utilizar esta arma antigua de destrucción total otra vez. Ahora Kyoji debe viajar por todo el mundo para descubrir el secreto de su propio pasado y luchar contra su mejor amigo, para salvar su futuro y el de todos.');
