INSERT INTO animes (nombre,foto,descripcion) VALUES ('naruto narutimate hero 3 tsuini gekitotsu jounin vs genin musabetsu dairansen taikai kaisai','https://cdn.jkdesu.com/assets/images/animes/image/naruto-narutimate-hero-3-tsuini-gekitotsu-jounin-vs-genin-musabetsu-dairansen-taikai-kaisai.jpg','Konoha organiza un torneo especial para ninjas de todos los rangos, despertando el fervor entre los novatos que están ansiosos por demostrar su valía en una competencia contra sus superiores. ¡Además, el ganador tiene la oportunidad de crear su propio decreto de aldea! A pesar de su entusiasmo por reclamar el premio, Naruto Uzumaki no se concentra en el objetivo del juego y se obsesiona con enfrentarse a su maestro, Kakashi Hatake, en combate singular.');
