INSERT INTO animes (nombre,foto,descripcion) VALUES ('chrno crusade','https://cdn.jkdesu.com/assets/images/animes/image/chrno-crusade.jpg','Rosette Christopher es una exorcista que trabaja para una organización religiosa (Orden de Magdalena). Además de su trabajo, ella realiza una búsqueda de su hermano, el cual ha sido secuestrado por un demonio (Aion). El objetivo de este demonio es la captura de los apóstoles, seres bendecidos con alguna cualidad divina. En su periplo, Rosette está acompañada por un demonio llamado Chronos, con el cual hizo un pacto para obtener su ayuda, con la desventaja de que cada vez que utilice la magia de Chronos, ella acortará su vida cada vez más.');
