INSERT INTO animes (nombre,foto,descripcion) VALUES ('tokio good fathers','https://cdn.jkdesu.com/assets/images/animes/image/tokio-good-fathers.jpg','3 vagabundos, con un pasado distinto y doloroso encuentran a una bebe abandonada en la noche de navidad, todos deciden ir en busca de sus padres y lo que no saben es que tendrán que enfrentarse a su pasado para poder lograrlo.');
