INSERT INTO animes (nombre,foto,descripcion) VALUES ('eureka seven','https://cdn.jkdesu.com/assets/images/animes/image/eureka-seven.jpg','En un mundo futurista sometido a fallas geológicas, extraños fenómenos naturales y otros no explicados por una Federación unida con ambición de gobernar al mundo, parte la historia de dos personajes, Renton y Eureka  que indirectamente cambiaran la visión del mundo sobre un suceso “Verano del amor” que ciertamente a dado punta pie para el inicio de investigación y guerras por parte de la federación unida y un grupo antitotalitarista con sus “propios ideales” que rivalizara contra ellos, su nombre es Gekko State y motivados por el suceso heroico de Adrock Thorston (fenomeno de las siete olas), padre de el protagonista Rentom Thorston harán lo imposible para interrumpir los planes de aquella federación unida, desvelar sus oscuros planes al mundo y lograr a toda costa un “contacto” para su salvacion.');
