INSERT INTO animes (nombre,foto,descripcion) VALUES ('bokusatsu tenshi dokuro chan','https://cdn.jkdesu.com/assets/images/animes/image/bokusatsu-tenshi-dokuro-chan.jpg','La chica ángel del futuro, quien tiene la misión de asesinar al creador del secreto para la juventud eterna es Dokuro-chan. Sin embargo ella es incapaz de cumplir su misión debido a sus sentimientos, entonces decide hacerlo a su manera. Es aquí donde veremos una historia llena de diversión, romance, aventura y mucha sangre.Ella nos enseñara una forma muy peculiar de mostrar afecto hacia los demás.');
