INSERT INTO animes (nombre,foto,descripcion) VALUES ('kikis delivery service','https://cdn.jkdesu.com/assets/images/animes/image/kikis-delivery-service.jpg','Conocida también como Kiki: entregas a domicilio y Nicky, la aprendiz de bruja es una película que cuenta las peripecias de una pequeña bruja de 13 años llamada Nicky (Kiki en la versión original). En esta obra Hayao Miyazaki muestra el comienzo del camino a la edad adulta del personaje, con la responsabilidad que ello conlleva.  Por tradición de las brujas al cumplir los 13 años deben abandonar la casa de los padres y buscar una ciudad donde sus servicios sean requeridos, y quedarse allí durante algún tiempo. De esta manera, Kiki comenzará el camino que la llevará a convertirse definitivamente en bruja. Este viaje lo realiza junto a su amigo Jiji, un gato negro que se encargará de la mayoría de los gags, y montada en su escoba voladora. Su viaje iniciático la llevará a instalarse en una ciudad marítima donde comenzará a conocer el mundo y a conocerse a sí misma.');
