INSERT INTO animes (nombre,foto,descripcion) VALUES ('strawberry panic','https://cdn.jkdesu.com/assets/images/animes/image/strawberry-panic.jpg','Astraea Hill es un lugar sagrado donde ningún hombre puede entrar. Ahí hay tres academias para chicas: St. Miatre, St. Spica y St. Le Rim. Junto a ellas está la casa de alojamiento común para los tres establecimientos, llamada Ichigo-Sha. Aoi Nagisa es transferida a St. Miatre, y en su primer día de clases conoce a Hanazono Shizuma, también conocida como Etoile. Ella es la admirada líder de las estudiantes de las tres academias, y Nagisa queda fascinada por su belleza.  ');
