INSERT INTO animes (nombre,foto,descripcion) VALUES ('street fighter ii v','https://cdn.jkdesu.com/assets/images/animes/image/street-fighter-ii-v.jpg','Durante un recorrido por todo el mundo realizado por Ken y Ryu encuentran amigos y enemigos a los que se tienen que enfrentar en batallas. Ryu un joven vagabundo es el primero de los Street Fighter en aprender una técnica especial llamada Hadoken (gran bola de energía), y Ken Master un hijo de uno de los hombres mas ricos de E.E.U.U es quien paga todo el viaje por su querido amigo Ryu.');
