INSERT INTO animes (nombre,foto,descripcion) VALUES ('mobile suit gundam 0083 stardust memory','https://cdn.jkdesu.com/assets/images/animes/image/mobile-suit-gundam-0083-stardust-memory.jpg','Esta historia nos cuenta los acontecimientos ocurridos entre Mobile Suit Gundam y Mobile Suit Z Gundam. Es el año 0083 del Universal Century, han pasado 3 años desde el fin de la Guerra entre Zeon y la Federación, y aparentemente hay paz en la Tierra. Pero un grupo de soldados remanentes de Zeon al mando de Aiguille Delaz y su piloto As, Anavel Gato, atacan la Base Torrington en Australia para robar uno de los dos nuevos prototipos Gundam y llevar a cabo su terrible venganza contra la Federación Terrestre, conocida como la Operación Polvo Estelar. Kou Uraki, un joven cadete estacionado en la base Torrtington, toma a su cargo el Gundam Unidad 1 para detener a Gato, uniendo fuerzas con la tripulación de la nueva nave de la Federación: La Albion. ');
