INSERT INTO animes (nombre,foto,descripcion) VALUES ('blood the last vampire','https://cdn.jkdesu.com/assets/images/animes/image/blood-the-last-vampire.jpg','Saya es la última de los vampiros en este mundo. El ejercito de los Estados Unidos la protege y usa para cazar a unos seres de apariencia humana, que se alimentas de la sangre humana llamados "quirópteros". En su última misión, Saya debe cazar a una de estas bestias que parece estar atacando a miembros de una base naval norteamericana en Japón. Antes de poder matarlo, Saya primero tiene que saber quién es el quiróptero, y se ve forzada a acudir como alumna a la escuela de la base.');
