INSERT INTO animes (nombre,foto,descripcion) VALUES ('btx','https://cdn.jkdesu.com/assets/images/animes/image/btx.jpg','El siglo XXI El imperio de las maquinas encontro la forma de crear robots con alma y sentimientos, estos fueron llamados betas. Kotaro Takamiya es un cientifico que ha tenido la mala suerte de ser secuestrado por el Imperio de las Maquinas; Es la mision de su hermano Teppei Takamiya, rescatarlo. En su lucha despierta a Bt´x, antiguo compañero de Karen, una de los cuatro guardianes espirituales que se le unen a Teppei, para vencer al corrompido Imperio de las Maquinas. Los guardianes espiriuales son, Fao, Ron, Hokuto y Karen.');
