INSERT INTO animes (nombre,foto,descripcion) VALUES ('ashita no joe 2','https://cdn.jkdesu.com/assets/images/animes/image/ashita-no-joe-2.jpg','Yabuki Joe queda desanimado y sin esperanza después de cierto evento trágico. En un intento por dejar atrás el pasado, Joe deja atrás el gimnasio y comienza a deambular. En sus viajes se encuentra con gente como Wolf Kanagushi y Goromaki Gondo, hombres que involuntariamente avivan las brasas agonizantes dentro de él, lo que lo lleva a poner fin a sus vagabundeos. Su regreso a casa vuelve a poner a Joe en el camino del boxeo, pero sin que él ni su entrenador lo supieran, ahora sufre problemas profundos que le impiden pelear. En un intento por solucionar esos problemas, Carlos Rivera, un boxeador de renombre mundial, es invitado desde Venezuela para ayudar a Joe a recuperarse.');
