INSERT INTO animes (nombre,foto,descripcion) VALUES ('saber marionette j','https://cdn.jkdesu.com/assets/images/animes/image/saber-marionette-j.jpg','Otaru Namiya es uno de los protagonistas, el cual en el transcurso del tiempo va encontrando las marionetas especiales que tienen lo que son considerados circuitos vírgenes, o una versión cibernético de corazones, que les permite descubrir y experimentar los sentimientos humanos. Lima, Cereza y Zarzamora, son los nombres de estas tres marionetas, las cuales hacen hasta lo imposible por cuidar y complacer a Otaru y velar por el bien del mundo y la única mujer humana que queda en este, Lorelei.');
