INSERT INTO animes (nombre,foto,descripcion) VALUES ('demonbane tv','https://cdn.jkdesu.com/assets/images/animes/image/demonbane-tv.jpg','La historia comienza en un mundo donde la ciencia y la magia han avanzado extraordinariamente. La ciudad de Arkham es una metrópolis prospera por magia altamente avanzada. Sin embargo es amenazada por "Black Lodge", una organización criminal controlada por Master Telion, quien es el mago más poderoso y malvado que existe, demostrando su reinado al actuar violentamente en la ciudad. La familia Hadou es quien protege la ciudad de esta amenaza, quienes crean al "dios mecanico Demonbane" para protegerla... El campo de esta preparado y la batalla entre Master Therion y Demonbane esta por comenzar.');
