INSERT INTO animes (nombre,foto,descripcion) VALUES ('witchblade','https://cdn.jkdesu.com/assets/images/animes/image/witchblade.jpg','La Witchblade es un artefacto de origen remoto y completamente desconocido, que otorga a su portadora una inconmesurable ansia de lucha y violencia, ademas de un gran poder. Solo puede ser llevada por mujeres, y una vez que elige a una para que la lleve no hay manera de deshacerse de ella, de escapar a ese sino. Masane Amaha es una mujer que perdio la memoria en un terrible suceso que sacudio Japon hace seis años, y posee la Witchblade sin saber lo que es ni por que la tiene. Ajena a su destino, su unica preocupacion es vivir tranquila con su hija Riko. Pero pronto el poder de la Witchblade se despertara de nuevo, y son muchas las manos que desean hacerse con la que podria ser el arma definitiva.');
