INSERT INTO animes (nombre,foto,descripcion) VALUES ('prince of tennis the national tournament','https://cdn.jkdesu.com/assets/images/animes/image/prince-of-tennis-the-national-tournament.jpg','Es inicio del torneo nacional(Zenkoku Taikai-Hen) es una serie de OVAs que sirven de continuación del anime Prince of Tennis, y trata sobre la participación del equipo de Seigaku en el 20º Torneo Nacional de Tenis Escolar de Japón. Se librarán batallas entre los lideres de diferentes escuelas. Especialmente el personaje principal Echizen Ryoma podrá descubrir el verdadero significado del tenis.');
