INSERT INTO animes (nombre,foto,descripcion) VALUES ('prince of tennis','https://cdn.jkdesu.com/assets/images/animes/image/prince-of-tennis.jpg','Ryoma Echizen es un chico de 12 años, bastante presumido y que no posee muy buenas relaciones personales con los demás. Vivía con toda su familia en Estados Unidos, pero tras llegar a Japón, tierra natal de su padre, tiene que adaptarse a su nueva vida en el instituto Seishun Gakuen (o llamada también como Seigaku), en el cual se apunta al Club de tenis. A partir de este momento, toda suerte de aventuras cambiarán la vida del chico, junto a sus compañeros de equipo y otros muchos personajes de equipos rivales que intentarán, con mejor o peor fortuna, robarle el título de "Príncipe del tenis", por su más que demostrada gran habilidad en este deporte.  Durante la serie se muestra como Echizen busca seguir y superar los pasos de su padre, quien fue un jugador profesional retirado de Japón. ');
