INSERT INTO animes (nombre,foto,descripcion) VALUES ('noir','https://cdn.jkdesu.com/assets/images/animes/image/noir.jpg','Mireille Boquet (asesina a sueldo) recibe el mail de una misteriosa chica pidiéndole ayuda. La misma no recuerda nada de su pasado, es perseguida por unos "mafiosos", es excelente asesina, y la única pertenencia que tiene es un reloj, cuya melodía le es muy familiar a Mireille. Trabajaran a duo e intentarán descubrir el misterioso pasado de Kirika, con una condición: Una vez descubierta la verdad, Mireille matará a Kirika.');
