INSERT INTO animes (nombre,foto,descripcion) VALUES ('dragon ball z movie 06 return of cooler','https://cdn.jkdesu.com/assets/images/animes/image/dragon-ball-z-movie-06-return-of-cooler.jpg','Cuando Dende, el nuevo kamisama, se entera de que el planeta Namek está en peligro, pide ayuda a Goku y sus amigos para que salven su planeta natal. Al llegar, Goku y los demás se dan cuenta de que una especie de estrella esta atacando al planeta. Detrás de todo esto esta Cooler, el hermano mayor de Freezer, al que pensaban que Goku había vencido.');
