INSERT INTO animes (nombre,foto,descripcion) VALUES ('gunslinger girl','https://cdn.jkdesu.com/assets/images/animes/image/gunslinger-girl.jpg','Ambientada en la Italia actual, relata la lucha de un grupo antiterrorista del Gobierno Italiano, que actúa encubierto usando como fachada el nombre de “Agencia de Bienestar Social”, contra el grupo terrorista de la República, usando un nuevo proyecto en el que recogen a niñas de entre 8 y 14 años, huérfanas y que por diversas circunstancias han perdido sus posibilidades de llevar una vida normal, mejoran sus cuerpos con partes cibernéticas y las someten a un proceso llamado “Acondicionamiento”, que no es ni más ni menos que una manipulación de sus mentes para borrarles la memorias para así conseguir que sean las armas perfectas, libres de remordimientos y capaces de matar a cualquiera sin titubear. Pero ese “Acondicionamiento” tiene un alto riesgo, ya que cada vez que son sometidas a uno de ellos, también se les acorta la vida.');
