INSERT INTO animes (nombre,foto,descripcion) VALUES ('final approach','https://cdn.jkdesu.com/assets/images/animes/image/final-approach.jpg','Mizuhara Ryo es el tipico estudiante de instituto. Una noche, mientras cenaba con su hermana pequeña, Akane, aparece una misteriosa y bella mujer, Masuda Shizuka sin haberse recuperado todavia de la sorpresa Shizuka les dice que es la esposa elegida de Ryo. Entonces es cuando aparece un hombre vestido de negro, siguiendo ordenes para completar un proyecto nacional. Asi comoienza una historia de amor repleta de comedia y pasión.');
