INSERT INTO animes (nombre,foto,descripcion) VALUES ('you are under arrest','https://cdn.jkdesu.com/assets/images/animes/image/you-are-under-arrest.jpg','Estás arrestado! cuenta la vida de la comisaría Bokuto donde trabajan Natsumi y Miyuki (Laura y Olivia en la traducción en español). La primera es una agente novata muy impulsiva y fanática de las motos, la otra es más calculadora y tranquila y es muy buena mecánica.  A lo largo de la serie veremos cómo van resolviendo toda clase de entuertos con la ayuda, muchas veces, de otros compañeros de su comisaría de lo más variopintos. Al mismo tiempo, vemos cómo se van desarrollando sus vidas cotidianas y preocupaciones de ambas, siempre con un buen toque de humor.');
