INSERT INTO animes (nombre,foto,descripcion) VALUES ('chobits','https://cdn.jkdesu.com/assets/images/animes/image/chobits.jpg','Hideki Motosuwa, quien decide abandonar el campo e irse a estudiar en Tokio para luego ir a la universidad, vive en un tiempo en el que las computadoras personales han sido desarrolladas para parecer y desempeñar funciones humanas, siendo llamadas como "Persocon". En su primer día, encuentra una de ellas tirada en la basura, tras lo cual se la lleva a su apartamento. Tras descubrir que es un modelo ‘especial’, denominado como Chobit, tiene descubrir su naturaleza a medida que se enfrenta a problemas comunes de adolescentes.');
