INSERT INTO animes (nombre,foto,descripcion) VALUES ('samurai 7','https://cdn.jkdesu.com/assets/images/animes/image/samurai-7.jpg','En un futuro lejano, en un planeta que una vez fue llamado Tierra, los campesinos del pueblo de Kanna sufren continuamente los ataques de los Nobuseri, samuráis arruinados por la ausencia de guerras en las que lucharon, por lo que para sobrevivir se dedican a robar la comida y las mujeres de los pequeños e indefensos pueblos. Un año antes de la época de cosecha, Gisaku, el jefe de uno de estos pueblos, propone contratar a unos samuráis para que les protejan de la amenaza de los Nobuseri. Kirara y Komachi, dos hermanas sacerdotisas, acompañadas por Riki, se ofrecen voluntarias para ir a la ciudad y buscar a los samuráis que les puedan defender.');
