INSERT INTO animes (nombre,foto,descripcion) VALUES ('hack sign','https://cdn.jkdesu.com/assets/images/animes/image/hack-sign.jpg','En el año 2005, un virus informático llamado "el Beso de Plutón" hizo caer completamente la red de internet mundial. En el 2007, después de la restauración de la red, se creó y se puso a la venta un juego online (MMORPG) llamado "El Mundo".  El anime se centra principalmente en Tsukasa, quien obtiene un poder que daña al jugador en la vida real. De repente se despierta para encontrarse en "El Mundo", siendo capaz de sentir, oler, tocar, ver y oír todo tal y como si él estuviera realmente allí. Intenta desconectar pero falla en ello. Siendo incapaz de recordar qué paso antes de despertar, vaga alrededor sin rumbo para encontrar respuestas. Mientras hace esto, los moderadores del sistema, los Caballeros Escarlata, sospechan que ha estado trabajando con hackers a causa del retorcido personaje con quien se encuentra. Tsukasa encuentra un objeto mágico que concede el poder de usar este temido "Guardián" que le protegerá de todo daño.');
