INSERT INTO animes (nombre,foto,descripcion) VALUES ('da capo second season','https://cdn.jkdesu.com/assets/images/animes/image/da-capo-second-season.jpg','Esta segunda temporada trata sobre la vida de los protagonistas dos años después de la anterior serie, lo que trae algunos cambios, además de nuevos personajes y la destacable ausencia de algunos antiguos. Siguen Jun''Ichi y sus amigos pero con un gran cambio, que revolucionó la vida de Jun''Ichi. Las cosas se complican cuando aparece Aisia, una niña que quiere que Jun''Ichi le enseñe magia, a pesar de que éste sólo sabe crear pequeños dulces japoneses de la nada. Además, todo se complicará con nuevas llegadas... Y regresos.');
