INSERT INTO animes (nombre,foto,descripcion) VALUES ('pale cocoon','https://cdn.jkdesu.com/assets/images/animes/image/pale-cocoon.jpg','Un futuro donde la continuidad de la historia ha sido interrumpida, donde una gran cantidad de enormes ruinas siguen sin fin. Los océanos y continentes ya no existen como tal, solo vestigios en los archivos mantienen el conocimiento del pasado. Ura trabaja restaurando estos archivos, y en uno de ellos encuentra algo perturbador...');
