INSERT INTO animes (nombre,foto,descripcion) VALUES ('yami no matsuei','https://cdn.jkdesu.com/assets/images/animes/image/yami-no-matsuei.jpg','Después de la muerte, las almas son llevadas a Meifu, donde serán juzgados según sus acciones por la gente de JuOhCho. Los "Shinigami" son humanos ya muertos que trabajan en pares para dicha asociación, y son los encargados de ir a buscar almas para guiarlas a Meifu. La historia se centra en la asociación Enmacho, donde trabaja Tsuzuki Asato, un adulto con alma de niño, quien no ha podido tener un compañero dentro de la agencia ya que todos lo abandonan, debido a su personalidad infantil y por sentirse culpable al ir a buscar a las personas que tienen la muerte en su destino próximo. Sin embargo, es el shinigami más poderoso. Kurosaki Hisoka es un chico de 16 años que murió a manos del excéntrico doctor Muraki Kazutaka y quién será puesto a trabajar junto al lado de Tsuzuki. Ellos, junto al tacaño Tatsumi y al científico Watari tendrán que trabajar juntos para descubrir qué trama Muraki y por qué está obsesionado con Tsuzuki.');
