INSERT INTO animes (nombre,foto,descripcion) VALUES ('fruits basket','https://cdn.jkdesu.com/assets/images/animes/image/fruits-basket.jpg','Honda Toru es una estudiante que después de la muerte de su madre decide vivir sola en una tienda de campaña en el bosque, propiedad de la familia Soma. Una noche es encontrada por Yuki Soma, el "príncipe" de su escuela, este y su primo Shigure le piden que viva con ellos. Dentro de la casa conoce a Kyo, otro integrante de la familia Soma y la terrible maldición que pesa sobre ellos que consiste que al ser abrazados por el sexo opuesto se transforman en animales del zodiaco chino (a excepción de Kyo que es el gato).');
