INSERT INTO animes (nombre,foto,descripcion) VALUES ('rurouni kenshin','https://cdn.jkdesu.com/assets/images/animes/image/rurouni-kenshin.jpg','La historia trata de un joven, el mayor asesino de la era Tokugawa hasta la Restauración Meiji, apodado Battousai. Este joven llamado Kenshin Himura, decide no volver a matar gente, y para poder pagar de alguna forma los asesinatos que cometió, decide proteger a las personas a su alrededor con la técnica más aterradora y poderosa en existencia: el Hiten Mitsurugi Ryū, aprendida gracias al adiestramiento de su maestro Seijuro Hiko , que lo acogió cuando era pequeño tras sobrevivir en el asesinato de la caravana de esclavos en que se encontraba, donde 3 hermanas lo habian adoptado como hermano menor. De esta manera conoce a Kaoru Kamiya, del dojo Kamiya Kasshin Ryū, Sanosuke, Yahiko y a otros personajes que pasan a ser parte de su vida, y motivo de existencia.');
