INSERT INTO animes (nombre,foto,descripcion) VALUES ('dna2','https://cdn.jkdesu.com/assets/images/animes/image/dna2.jpg','En un futuro donde el viaje en el tiempo y la alteración del ADN es una realidad, la sobrepoblación esta llevando a la humanidad hacia la extinción. Los investigadores se dan cuenta de la existencia de un humano en el siglo XX con un gen especial, el cual lo hace extremadamente fértil e irresistible a las mujeres. Esta persona tuvo 100 hijos los cuales heredaron ese gen, convirtiéndose en la mayor causa de la sobrepoblación. Se decide enviar a Karin al pasado para alterar el ADN de esa persona, y de esta forma disminuir el problema en el futuro.');
