INSERT INTO animes (nombre,foto,descripcion) VALUES ('kigeki comedy','https://cdn.jkdesu.com/assets/images/animes/image/kigeki-comedy.jpg','La leyenda habla de un espadachín solitario que vive en el Castillo del Demonio, un castillo en ruinas cerca del Bosque Negro.Este misterioso extranjero sólo acepta libros raros por sus servicios, libros antiguos del pasado.Comedy nos cuenta la historia de una jovencita que desea desesperadamente salvar a su familia y su pueblo de la ira de los soldados ingleses, entregando un preciado libro a cambio de la hazaña.Con sus piernas como unica ayuda, corre hacia el Bosque Negro, esperando llegar a tiempo.');
