INSERT INTO animes (nombre,foto,descripcion) VALUES ('macross zero','https://cdn.jkdesu.com/assets/images/animes/image/macross-zero.jpg','Es la precuela del anime The Super Dimension Fortress Macross. La historia se desarrolla 9 años después de la caída de una nave alienígena en la tierra (SDF-1 Macross) y un año antes de la primera guerra contra los Zentraedi. La trama se centra en un joven de nombre Shin Kudō, piloto de un F-14 de la U.N, cuyo avión es derribado por un misterioso caza, con la capacidad de transformarse en un humanoide cayendo sobre una isla conocida como Mayan ahi conoce a Sara y a Mao iniciando un triangulo amoroso , junto a la lucha contra las prototopos de VF.');
