INSERT INTO animes (nombre,foto,descripcion) VALUES ('mobile suit gundam 0083 the fading light of zeon','https://cdn.jkdesu.com/assets/images/animes/image/mobile-suit-gundam-0083-the-fading-light-of-zeon.jpg','U.C. 0083 - Tres años han pasado después de la "Guerra de Un Año", cuando un grupo de bandidos de Zeon conocidos como "La Flota Delaz" hace su movimiento robando el prototipo "Gundam GP02A". Esta aventura comienza cuando el piloto novato, Kou Uraki, toma control del Gundam GP01 para perseguir al as veterano de Zeon, Anavel Gato, con intención de recuperar el prototipo robado... ');
