INSERT INTO animes (nombre,foto,descripcion) VALUES ('mobile suit zeta gundam','https://cdn.jkdesu.com/assets/images/animes/image/mobile-suit-zeta-gundam.jpg','Tras ser definitivo el término de la guerra de un año, UC 0087. Siete años después, la libertad aun se escucha en voz alta por parte de los pobladores de las colonias, exigiendo justicia y libertad pero parece no importarle el tema a la corrupta Federación Terrestre, haciendo todo lo contrario enviando a sus fuerzas llamados ''Titans'' para reprimirlos con violencia. Esto hace que un grupo de rebeldes cobre fuerza llamados AEUG quienes ya se encuentran listos para combatir. Lanzado el primer ataque por parte de los ''AEUG'' sobre el cuartel de los ''Titans'' esto se convierte en una guerra civil dejando de ser un tema exclusivamente político. Un intrépido joven se une al conflicto, Camille Bidan que se convertirá en el piloto ''Gundam'' de una nueva era. ');
