INSERT INTO animes (nombre,foto,descripcion) VALUES ('trinity blood','https://cdn.jkdesu.com/assets/images/animes/image/trinity-blood.jpg','Después del Armagedon, aparecieron ciertas criaturas inteligentes que se alimentaban de sangre humana, en base a las antiguas leyendas se les llamó "Vampiros". Entonces comenzó una guerra fría entre el Imperio de la Humanidad Verdadera, nación de los vampiros, y el Vaticano, convertido ahora en el centro de la civilización Humana. Aunque ninguna de las dos partes desea una guerra, existe un grupo extremista que busca deshacer el pequeño equilibrio entre las dos naciones y comenzar la lucha: la Orden Rozenkreuz. Por ello en el Vaticano la Cardenal Caterina Sforza, ministra de Asuntos Exteriores, ha creado la Agencia AX, cuyos miembros son clérigos entrenados para la batalla y que poseen habilidades especiales. Entre ellos se encuentra el Protagonista, Abel Nightroad, quien es realmente un Cruznik, una especie diferente y casi desconocida que se alimenta de la sangre de los vampiros.');
