INSERT INTO animes (nombre,foto,descripcion) VALUES ('karin','https://cdn.jkdesu.com/assets/images/animes/image/karin.jpg','Karin Maaka es una adolescente que vive en el Japón actual con su familia. Aunque parece una chica normal, guarda el secreto de ser descendiente de una larga estirpe de vampiros que emigro al país. La muchacha no sólo forma parte de un grupo rechazado socialmente sino que ella también lo es entre sus pares por no ser una "vampiresa normal", debido a que no necesita beber sangre, soporta el sol, no le gusta la oscuridad, y especialmente porque debe morder de vez en cuando a los humanos para inyectarles la sangre demas que produce.');
