INSERT INTO animes (nombre,foto,descripcion) VALUES ('rozen maiden','https://cdn.jkdesu.com/assets/images/animes/image/rozen-maiden.jpg','Son 7 muñecas de porcelana que su creador dio vida al cual todas llaman "Padre". Todas tienes que entrar al juego de "Alice", en este tienen que pelear entres si para así quedarse con la roza mística de la perdedora (osea lo que las mantiene vivas); La que consiga obtener todas la rosas místicas sera llamada "Alice" la cual tendrá la oportunidad de estar con "padre" puesto que él considera que Alice es la muñeca mas hermosa y perfecta que exista.  La protagonista de esta serie se llama Shinku (la  quinta muñeca en ser creada) va a parar con el coprotagonista de esta serie (Jun) el cual la obtuvo por medio de la Internet ya que gusta de comprar cosas extrañas por este medio, este a su vez se convierte en el médium de Shinku (el que le proporciona energía). Las demas muñecas están por aparecer y al estar todas empezara...."El juego de Alice".');
