INSERT INTO animes (nombre,foto,descripcion) VALUES ('full metal panic fumoffu','https://cdn.jkdesu.com/assets/images/animes/image/full-metal-panic-fumoffu.jpg','En Fumoffu veremos de nuevo las andanzas de Sōsuke y Chidori pero con un tono cómico más marcado. La historia se desarrolla sin los AS ya que toda la trama se encuentra fuera de los campos de batalla de Mithril. En su lugar la historia se desarrolla en la escuela y lugares aledaños, además de que observaremos a Sōsuke utilizando el disfraz del muñeco Bonta-kun, que es el apelativo común en Japón para los osos de peluche, con el que realizara varias aventuras y meterse en todo tipo de problemas con sus intentos fallidos para adaptarse a la vida común y corriente de Japón.');
