INSERT INTO animes (nombre,foto,descripcion) VALUES ('neon genesis evangelion death rebirth','https://cdn.jkdesu.com/assets/images/animes/image/neon-genesis-evangelion-death-rebirth.jpg','Es la primera película de la serie de televisión Neon Genesis Evangelion. Consiste en dos partes: Death y Rebirth, Muerte y Renacimiento respectivamente. La primera parte, Death, consiste de una edición de 60 minutos sobre los primeros 24 episodios del programa de televisión, que incluye varias escenas inéditas. La segunda parte, Rebirth, consiste en una historia y animación completamente nuevas, ubicadas inmediatamente después del episodio 24. Debido a falta de tiempo, esta parte no fue terminada completamente al momento del lanzamiento, y sólo los primeros 27 minutos de un total de 40 fueron estrenados. Cuatro meses más tarde, The End of Evangelion, la segunda película de Evangelion presentó la animación completa, que recibió el nombre Air (Episodio 25).');
