INSERT INTO animes (nombre,foto,descripcion) VALUES ('groove adventure rave','https://cdn.jkdesu.com/assets/images/animes/image/groove-adventure-rave.jpg','Hace 50 años las piedras rave se enfrentaron a las piedras de las sombras,la gran explosión esparció las piedras por todo el mundo. Ahora el nuevo rave master (haru glory) debe de encontrar las piedras rave y destruir las piedras de las sombras con ayuda de sus amigos musika,elie,plue y griffon.');
