INSERT INTO animes (nombre,foto,descripcion) VALUES ('digimon digital monsters','https://cdn.jkdesu.com/assets/images/animes/image/digimon-digital-monsters.jpg','Siete niños disfrutan de sus vacaciones de verano en un campamento, cuando de repente, se ven envueltos en un misterios mundo: El Mundo Digital. Un mundo paralelo al suyo formado a partir de datos digitales. Allí conocen a sus compañeros los digimon, y juntos tendrán que solucionar los extraños sucesos que aterran la Isla File, provocados por Devimon. Pero tal vez no sea esa el único motivo por el que aparecieron en aquél misterioso mundo, tendrán que afrontarse a más de una aventura para descubrirlo y volver a su mundo original.');
