INSERT INTO animes (nombre,foto,descripcion) VALUES ('full metal panic tsr','https://cdn.jkdesu.com/assets/images/animes/image/full-metal-panic-tsr.jpg','The Second Raid (TSR) es la secuela del primer Full Metal Panic y continúa la historia desde el final de la anterior. Basado en la novela de Full Metal Panic la versión anime entra en más detalles íntimos de Sousuke y Kaname, y por supuesto, de acción.  La serie comienza dos meses después de los eventos ocurridos en el Tuatha de Danaan al final de la serie original (Full Metal Panic). Mithril toma conciencia de una organización secreta que tiene en sus manos tecnología capaz de contener el modo ECS (Electronic Cloaking System).');
