INSERT INTO animes (nombre,foto,descripcion) VALUES ('pokemon','https://cdn.jkdesu.com/assets/images/animes/image/pokemon.jpg','Este chico vive en Pueblo Paleta con su madre (del padre no se sabe nada). En este pueblo también vive una autoridad del mundo Pokémon, el Profesor Oak, quien le entrega a todos los nuevos entrenadores su primer Pokémon y una herramienta llamada Pokedex (una enciclopedia de alta tecnología con información sobre todos los Pokemon), es esta persona quien le da su primer Pokemon a Ash, como ustedes bien sabran, un Pikachu.');
