INSERT INTO animes (nombre,foto,descripcion) VALUES ('zoids shinseikizero','https://cdn.jkdesu.com/assets/images/animes/image/zoids-shinseikizero.jpg','Zoids/Zero Esta serie ocurre años después de la segunda estación del planeta ZI (seria tiempo después de la serie de la fuerza guardián con bang y fine). Se trata de un muchacho llamado Bit cloud que era distribuidor de chatarra cuando el interrumpió accidentalmente una batalla del equipo blitz. le tomo una noche reconstruir el LIGER ZERO y se unió a este grupo ,el liger zero era un zoid ideal para estas batallas.');
