INSERT INTO animes (nombre,foto,descripcion) VALUES ('wolfs rain','https://cdn.jkdesu.com/assets/images/animes/image/wolfs-rain.jpg','Wolf''s Rain transcurre en un futuro post-apocalíptico, donde gran parte del mundo ha sido ecológicamente devastado, y la mayoría de la gente vive en la pobreza. La leyenda escrita en el Libro de la Luna dice que los lobos son seres místicos que vinieron al mundo desde un lugar llamado Rakuen (Paraíso), al amanecer de los tiempos. También se dice que, en el futuro, los lobos encontrarían, con la ayuda de una misteriosa joven llamada La chica Flor (un ser creado de la esencia de flores lunares), el camino de regreso al paraíso y al hacerlo, reiniciarían al mundo. Esta leyenda es difícil de creer para muchos, pues se cree que los lobos se extinguieron 200 años atrás. Pero, la verdad es que los lobos se han hecho expertos en ocultarse dentro de la sociedad humana');
