INSERT INTO animes (nombre,foto,descripcion) VALUES ('dragon ball gt','https://cdn.jkdesu.com/assets/images/animes/image/dragon-ball-gt.jpg','Esta es la etapa final de Dragon Ball, aquí veremos a un Goku un poco mas viejo acompañado de Oob, la reencarnacion de Boo. Ahora Oob, despues de un largo entrenamiento, se ha vuelto muy fuerte junto a Goku. Ahora un nuevo problema se le presenta a Goku, el ha sido convertido en niño por un viejo enemigo, con unas esferas de dragón nunca antes vistas, pero éstas no se esparcen por La Tierra, si no por la galaxia, además, si no encuentran las esferas en un determinado tiempo, La Tierra explotará. Esto llevara a Goku, Trunks y su nieta Pan, a una aventura por toda la galaxia.');
