INSERT INTO animes (nombre,foto,descripcion) VALUES ('angel sanctuary','https://cdn.jkdesu.com/assets/images/animes/image/angel-sanctuary.jpg','Dios esta muerto, y el fin llegara a menos que el angel caido Alexiel pueda reencarnar y prevenirlo. Pero hace años, el cuerpo de Alexiel fue encerrado en un cristal, mientras su alma esta continuamente reencarnando como un humano que morirá en una pronta y violenta muerte, una vez tras otra, como fuera de la sociedad --marginado y rechazado. Esta vez el alma de Alexiel se ha reencarnado dentro de un joven delincuente llamado Setsuna Mudou -- el Messiah profetizó que salvaría la humanidad en el Libro Negro de la Revelación. Aunque Setsuna no conoce por la batalla que vendrá entre el cielo y el infierno pero solo por su amor... su hermana Sara Mudou. Empezara la historia de ángeles, demonios y un dios perdido.');
