INSERT INTO animes (nombre,foto,descripcion) VALUES ('neon genesis evangelion the end of evangelion','https://cdn.jkdesu.com/assets/images/animes/image/neon-genesis-evangelion-the-end-of-evangelion.jpg','El final original de Neon Genesis Evangelion mostrado en los dos últimos capítulos de la serie de TV fue criticado unánimemente debido a la enorme cantidad de preguntas que dejó sin resolver. Sin más remedio, GAINAX decidió rehacer el final lanzando la película The End of Evangelion (El Final de Evangelion), que sustituye a los dos últimos episodios de la serie de TV. The End of Evangelion nos narra los acontecimientos ocurridos tras la muerte del último Ángel, revelándose un plan orquestado desde las sombras para forzar la evolución de la Humanidad, con un carácter cada vez más apocalíptico y oscuro mientras avanza la película, resolviendo las dudas dejadas de lado en el final original.');
