INSERT INTO animes (nombre,foto,descripcion) VALUES ('ashita no joe','https://cdn.jkdesu.com/assets/images/animes/image/ashita-no-joe.jpg','Ashita no Joe nos cuenta la historia de un boxeador, Joe Yabuki. Joe no es un boxeador como otros: es un huérfano que pasaba su vida en la calle hasta el día en el que encuentra a un viejo borracho llamado Danpei Tange. Danpei, boxeador profesional retirado, se queda asombrado porla fuerza bruta de Joe y decide hacer de él un gran boxeador. Joe no le hace caso y sus fechorias finalmente le llevan aun reformatorio para jovenes delicuentes. Ese es el lugar en el que conoce a Toru Rikiishi,una joven promesa del boxeo injustamente recluido . Joe decide entonces dedicarse al boxeo con el fin de derrotar a este gran rival.');
