INSERT INTO animes (nombre,foto,descripcion) VALUES ('cardcaptor sakura movie 2 the sealed card','https://cdn.jkdesu.com/assets/images/animes/image/cardcaptor-sakura-movie-2-the-sealed-card.jpg','Cuando Sakura creyó que el problema de las cartas clow había finalizado, pronto se dará cuenta de lo equivocada que está. La carta de la nada, una carta que funciona como fuente de equilibrio para las demas cartas, aparece de súbito de entre las ruinas de la mansión de Eriol Hiragisawa (la reencarnación del mago Clow) la cual fue demolida para construir en su lugar un parque de diversiones.Los problemas para Sakura se agrandan aun mas con el inesperado regreso de Li Syaoran a quien intenta devolverle su declaración de amor al tiempo que tienen que lidiar con el problema de la carta, la cual para sellarla, Sakura tiene que pagar un enorme precio ');
