INSERT INTO animes (nombre,foto,descripcion) VALUES ('love hina spring special','https://cdn.jkdesu.com/assets/images/animes/image/love-hina-spring-special.jpg','Las pruebas han llegado, y Keitaro sólo espera tener éxito. Sin embargo, en el tramo final, fracasa miserablemente y sueños a través de la prueba. Suponiendo que se ha fallado, se escapa, por lo que el resto del elenco le persigue en una isla desierta para traerlo de vuelta.');
