INSERT INTO animes (nombre,foto,descripcion) VALUES ('girls bravo first season','https://cdn.jkdesu.com/assets/images/animes/image/girls-bravo-first-season.jpg','Yukinari es un estudiante de instituto que siempre había sido rechazado por las chicas por ser de baja estatura, y al final acabó por ser "alérgico" a las mujeres, cuando las tocaba, era como si tocase una ortiga. Un día tras volver del instituto, se coló por el desague de la bañera y llegó a "Siren", un sitio en el que sólo había mujeres. Preocupado por su "alergia", intentó volver a la Tierra... Miharu, una chica misteriosa que conocio Yukinari en "Siren", Kirie, amigo y compañero de Yukinari, Koyomi, una chica que sufre una "alergia" como la de Yukinari pero con los chicos, Tomoka, que parece una niña pequeña, y los ruidosos hermanos Fukuyama Kazuharu y Risa seran los compañeros de aventura de Yukinari en la estraña tierra de "Siren".');
