INSERT INTO animes (nombre,foto,descripcion) VALUES ('ouran high school host club','https://cdn.jkdesu.com/assets/images/animes/image/ouran-high-school-host-club.jpg','La historia gira alrededor de Haruhi Fujiuoka, una estudiante de clase media que ha sido becada en el prestigioso instituto Ouran para familias ricas. Un día, buscando un lugar pacifico donde estudiar, se encuentra con la 3ra. sala de música y al abrir la puerta aparece el Ouran Host Club. Haruhi intenta salir, pero se lo impiden los integrantes del club: Kaoru y Hikaru Hitachiin, Takashi Morinozuka, Mitsukuni Haninozuka, Kyouya Ootori y el rey Tamaki Suou quienes la creen hombre por su forma en que viste. Tamaki comienza a hacerle preguntas indiscretas, poniéndola nerviosa y hace que Haruhi, sin querer, rompa un jarron cuyo valor es de 8,000,000 de yenes, ella ofrece pagarlo, pero no tiene dinero y asi se ve obligada a trabajar en el Host Club para pagar su deuda. Tamaki al poco rato se da cuenta del "potencial" que tiene en sus ojos y la asciende de perrito, al nivel de Host, argumentando que si consigue que 100 clientes la asignen como anfitrión sera libre de dejar el club.');
