INSERT INTO animes (nombre,foto,descripcion) VALUES ('zenki','https://cdn.jkdesu.com/assets/images/animes/image/zenki.jpg','Hace tiempos ancestrales, un demonio llamado Karma intentó destruir el mundo junto a sus semillas del mal, pero gracias a la fuerza de un guerrero guardián llamado Zenki, el mundo volvió a la normalidad tras numerosas batallas. Ozune Enno, maestro del templo Enno en esos años, sello a la bestia guardiana dentro de un pilar debido a su salvajismo, y cuando fuera necesario uno de sus descendientes volvería a convocarlo para que los ayudase. Pero tras 1.200 años de paz en el mundo, extrañamente las semillas del mal vuelven a aparecer y atacar a las personas de la ciudad de Shikigami-Cho, donde habita Chiaki Enno (conocida en inglés como Cherry), y ella es la única que puede convocar nuevamente al guerrero Zenki para volver a poner las cosas en orden, ya que es uno de los únicos descendientes directos que quedan vivos dentro de la dinastía Enno, y es ayudada por su abuela y su tío abuelo.');
