INSERT INTO animes (nombre,foto,descripcion) VALUES ('ikkitousen','https://cdn.jkdesu.com/assets/images/animes/image/ikkitousen.jpg','Kantou, un lugar donde los estudiantes de instituto luchan entre sí en combates brutales. Allí, 7 institutos: Secundaria Rakuyou, Instituto Nanyou, Instituto Kyosa, Campus Yoshu, Instituto Yoshu, Campus Seitou y Secundaria Ryoshu luchan para mostrar su poder al mundo. Sin importar el género, los institutos luchan entre sí. Un día, unos muchachos que disfrutan con la lucha, deciden poner (Madatamas) (unas joyas ancestrales en forma de coma) en sus cuerpos. Las Madatamas que poseían contenían el destino de los guerreros del periodo (Sangokushi), de hace mucho tiempo, cuyos espíritus están sellados en su interior.');
