INSERT INTO animes (nombre,foto,descripcion) VALUES ('cardcaptor sakura the movie 1','https://cdn.jkdesu.com/assets/images/animes/image/cardcaptor-sakura-the-movie-1.jpg','Todo comienza cuando Sakura en una ocasión, se gana el premio mayor de un sorteo el cual consiste en un viaje con todos los gastos pagados a Hong Kong. Una vez allí, Sakura (acompañada de su hermano, de Yukito de Kero y de Tomoyo) conoce a la familia de Shaoran, pero esto genera dudas en Kero quien se pregunta si este viaje fue pura suerte o estaba arreglado. Sus respuestas pronto se dejan ver cuando tras ver como Sakura experimenta una situación paranormal, se da cuenta que este viaje fue planeado por el espiritu de una antigua rival del mago Clow. ');
