INSERT INTO animes (nombre,foto,descripcion) VALUES ('matantei loki ragnarok','https://cdn.jkdesu.com/assets/images/animes/image/matantei-loki-ragnarok.jpg','Loki el poderoso dios nórdico del engaño perdió sus poderes y fue expulsado del reino del los dioses por el rey de los dioses Odín, convertido en un niño de apenas 8 años es enviado a la tierra, donde se encargara de capturar espíritus malignos si es que desea regresar al mundo de los dioses. En la tierra funda una agencia de detectives, La Agencia De Detectives Enjaku, mediante la cual conoce a su primer cliente una chica llamada Mayura Daijouji, la cual es una gran admiradora de los sucesos paranormales, la cual termina uniéndose a la agencia y ayudándolos con sus casos. Conforme avanza la serie, loki ira recolectando mas y mas espíritus malignos ya que esta es la única forma de que el recupere sus poderes y pueda volver al mundo de los dioses, pero Odín no permitirá que esta tarea se le haga muy fácil ya que envía mediante engaños a otros dioses para que interfieran en su misión y no permitan que vuelva al mundo de los dioses.');
