INSERT INTO animes (nombre,foto,descripcion) VALUES ('ichigo 100','https://cdn.jkdesu.com/assets/images/animes/image/ichigo-100.jpg','La historia trata sobre un joven llamado Manaka Junpei, un estudiante de secundaria que no tiene mucho éxito con las mujeres. Desde niño siempre a tenido la ilusión de ser un gran cineasta reconocido, es por eso que al terminar la secundaria, piensa entrar a la preparatoria Izumisaka la cuál tiene un club de cine. Un día, Junpei sube a la azotea de la escuela, y de repente, le cae de encima una preciosa chica con panties con fresas alrededor (Ichigo es fresa en japones). Junpei queda muy asombrado ante la belleza de la joven, la cual le da mucha verguenza y se va corriendo. Al parecer, accidentalmente, la joven olvida su cuaderno y Junpei se entera que el cuaderno pertenece a Toujo Aya, asi que decide buscarla al día siguiente para saber la identidad de la joven.');
