INSERT INTO animes (nombre,foto,descripcion) VALUES ('mobile suit gundam zz','https://cdn.jkdesu.com/assets/images/animes/image/mobile-suit-gundam-zz.jpg','Secuela inmediata de Mobile Suit Z Gundam. Es el año 0088 del Universal Century, luego de la terrible batalla final contra los Titans, la nave Argama del AEUG, vuela por suministros y mantencion a la colonia Shangri-La en Side 1. Al llegar, Juadu Ashta, y su grupo de amigos adolescentes recolectores de Chatarra, ven con la llegada del Argama una oportunidad de hacer dinero robando uno de sus Mobile Suits, el Z Gundam. Pero durante el robo, las cosas salen mal y Judau acaba conociendo a Kamille Bidan, un joven Newtype que hace que Judau cambie la perceción de las cosas que pasan a su alrededor. Pero no hay mucho tiempo para meditar, ya que las Fuerzas de Neo Zeon, al mando de la implacable Haman Karn, surgen desde el Asteroide Axis para reconquistar la Esfera Terrestre y reestablecer la perdida gloria de Zeon y la Familia Zabi. ');
