INSERT INTO animes (nombre,foto,descripcion) VALUES ('tenchi muyo gxp','https://cdn.jkdesu.com/assets/images/animes/image/tenchi-muyo-gxp.jpg','Seina Yamada podría considerarse el chico con la peor suerte del mundo, ya que todo lo malo que puede pasar le pasa a él y a cualquiera que este cerca de este. Al parecer esto cambia al unirse a la policía galáctica recomendado por una linda detective. Aquí es donde empieza su travesía conociendo a las chicas mas sexys y convirtiéndose en el cadete mas odiado, tanto por los otros cadetes como por los piratas de todo el universo. ');
