INSERT INTO animes (nombre,foto,descripcion) VALUES ('gungrave','https://cdn.jkdesu.com/assets/images/animes/image/gungrave.jpg','Brandon Heat es un pandillero de los suburbios de la ciudad, el junto con sus amigos se ven emvueltos en una disputa en la que solo sobreviven él y su mejor amigo Harry McDowel; tras ser salvados por miembros de un sindicato de la mafia deciden unirse a este. Escalando posciones rapidamente, Brandon y Harry se convierten en miembros muy importantes, sin embargo Harry cegado por su ambicion le dispara a su mejor amigo causandole la muerte, o por lo menos eso cree él. Ahora Brandon vuelve de entre los muertos buscando venganza.');
