INSERT INTO animes (nombre,foto,descripcion) VALUES ('petopeto san','https://cdn.jkdesu.com/assets/images/animes/image/petopeto-san.jpg','La historia se desarrolla en una ciudad donde existen otras razas especiales a parte de la Humana, que aunque no difiere mucho en el físico,tienen habilidades especiales. La historia se centra en las aventuras de Hanako (Petoko) una raza especial tipo petopeto (con la habilidad de pegarse a otra persona cuando la toca) y su relación con sus amigos.');
