INSERT INTO animes (nombre,foto,descripcion) VALUES ('kiba','https://cdn.jkdesu.com/assets/images/animes/image/kiba.jpg','El personaje principal de Kiba es Zed, un muchacho de 15 años que vive en un lugar llamado “Calm”. La situación actual de su vida lo frustra y siente que en alguna parte hacia fuera hay un lugar en donde él puede vivir más libremente. Un día, araido por un viento misterioso, Zed se zambulle en una hendidura del espacio-tiempo (portal), buscando las respuestas que pudieran estar allí. Llevado por el viento, él consigue transportarse a un mundo en guerra, en el cual libran batallas los "Shard Caster", usuarios mágicos que usan seres que invocan mediante esferas llamadas "Shiftings", con las cuales también usan spirits.');
