INSERT INTO animes (nombre,foto,descripcion) VALUES ('mazinger z','https://cdn.jkdesu.com/assets/images/animes/image/mazinger-z.jpg','El villano Dr. Hell ha acumulado un ejercito de bestias mecanicas en su escondite secreto, la isla de Bardos ubicada en el Mar Egeo. Es capaz de controlar a las bestias mecanizadas con su baston y les indica que desaten ataques devastadores. Sin embargo, el Dr. Hell no hace todo el trabajo sucio solo; el tiene su fiel secuaz, el baron Ashura, para llevar a cabo sus planes diabólicos.  Tambien hay quienes veran que el mal no prevalezca. Kouji Kabuto es el joven y luchador adolescente con una cuenta pendiente: su objetivo es vengar el asesinato de su abuelo por el Dr. Hell. Y podria ser capaz de lograrlo, ya que es el piloto de Mazinger Z, un poderoso robot gigante hecho de un metal indestructible conocido como Super-Alloy Z.  Mazinger Z cuenta con varios ataques especiales poderosos. Al canalizar la energia fotonica a traves de sus ojos y al liberar el haz de Koushiryoku, puede causar una gran destruccion. Pero las cosas se ponen realmente geniales cuando Mazinger Z lanza su ataque Rocket Punch. ¡El Dr. Hell y sus secuaces podrian haber encontrado su pareja!');
