INSERT INTO animes (nombre,foto,descripcion) VALUES ('ah my goddess','https://cdn.jkdesu.com/assets/images/animes/image/ah-my-goddess.jpg','La historia se centra en Keiichi Morisato, en un inicio estudiante universitario, aficionado a las motocicletas. Un día, Keiichi llama accidentalmente a una "línea de ayuda técnica de las diosas", intentaba encargar comida a domicilio. Y la hermosa diosa Belldandy aparece detrás de él, ofreciéndole un deseo. Asumiendo que es una broma, Keiichi desea que Belldandy (que encuentra muy atractiva) permanezca con él para siempre, y su deseo es inmediatamente concedido. Esto se complica cuando las hermanas de Belldandy, Urd y Skuld, se mudan con ellos, trayéndoles muchísimos más problemas.');
