INSERT INTO animes (nombre,foto,descripcion) VALUES ('beck','https://cdn.jkdesu.com/assets/images/animes/image/beck.jpg','Yukio Tanaka ("Koyuki") un chico de 14 años, conoce a Minami Ryuusuke, guitarrista de 16 años criado en EEUU, el cual le abre las puertas al mundo de la música. Yukio Tanaka, tras aprender a tocar la guitarra, pasara a formar parte de la banda de Rock de Minami Ryuusuke junto a otros 3 componentes. La historia nos mostrara el camino que recorre, este grupo, llamado Beck, por convertirse en profesionales, la relación de amistad que se crea entre todos, así como la evolución personal de cada uno de ellos.');
