INSERT INTO animes (nombre,foto,descripcion) VALUES ('mahou sensei negima','https://cdn.jkdesu.com/assets/images/animes/image/mahou-sensei-negima.jpg','Negi Springfield tiene solo 10 años, pero se graduo el primero en una academia de magia de Inglaterra. Para convertirse en un gran mago (Magister Magi), le mandaron a la Academia Mahora en Japón para mejorar sus habilidades, ya que el director del colegio era amigo de su abuelo. Es asignado como profesor de una clase de octavo, pero para su sorpresa, todas las de su clase son chicas, y bastante peculiares: una chica muy nerviosa bastante empollona, una tímida adicta a la lectura, y hasta una robot fémina y una mujer vampira. Rodeado por todas estas chicas se meterán en bastantes lios.');
