INSERT INTO animes (nombre,foto,descripcion) VALUES ('mobile suit gundam','https://cdn.jkdesu.com/assets/images/animes/image/mobile-suit-gundam.jpg','Debido a la sobrepoblación mundial, las guerras y el hambre, los humanos emigran al espacio exterior buscando mejores expectativas de vida. Comienza la construcción de cientos de gigantescas colonias espaciales que son agrupadas en Sides (grupos de entre 35 y 80 colonias), comienza un nuevo calendario para la humanidad, el UNIVERSAL CENTURY.  Es el año 0079 del Universal Century (U.C.0079), las colonias espaciales de Side 3, el Side más alejado de la Tierra, se proclaman a sí mismas como el Principado de Zeon, iniciando una feroz guerra de independencia contra el Gobierno de la Federación Terrestre.  Amuro Ray es un perezoso joven amante de las máquinas que vive en una de las colonias de Side 7. Poco sabe Amuro del proyecto secreto que se desarrolla en su colonia, el nuevo Mobile Suit modelo Gundam de la Federación Terrestre, cosa que traerá la guerra hasta las puertas de su casa y al mismísimo Char Aznable, piloto As de Zeon.  Víctima de las circunstancias, Amuro se ve frente a los controles del Gundam. Ahora, él deberá encargarse de pilotar el arma definitiva de la humanidad para salvar a sus seres queridos y su propia vida...');
