INSERT INTO animes (nombre,foto,descripcion) VALUES ('kaleido star','https://cdn.jkdesu.com/assets/images/animes/image/kaleido-star.jpg','Desde muy pequeña, Sora Naegino a soñado con actuar dentro del escenario de Kaleido donde se realizan espectaculos con acrobatas muy talentosos, por lo que la a cautivado desde su primera visita. Pasado el tiempo, ya tiene 16 años por lo que decide viajar hasta America para intentar ingresar y cumplir sus metas dentro del Escenario Kaleido. Ahi conocera y enfrentara muchos desafios y situaciones que le haran saber que no solo actuar en el escenario sera lo dificil.');
