INSERT INTO animes (nombre,foto,descripcion) VALUES ('earth maiden arjuna','https://cdn.jkdesu.com/assets/images/animes/image/earth-maiden-arjuna.jpg','Cuando una chica llamada Juna Ariyoshi tiene un accidente grave, su espíritu se convierte en luz y sale de su cuerpo hacia el cielo nocturno donde, durante unos instantes, ve la Tierra unos meses en el futuro. Lo que ella ve es la Tierra al borde de la destrucción total, por las fuerzas de un mundo cruel gobernado por demonios llamados Rajas. Entonces, la persona llamada Chris le da a Juna una "piedra de poder" y le dice que la use para salvar la Tierra. El poder de la piedra le da la habilidad de convocar un "traje aura", que mejora los propios poderes especiales de una persona que de otra manera permanecerían dormidos.');
