INSERT INTO animes (nombre,foto,descripcion) VALUES ('dragon ball z movie 13 wrath of the dragon','https://cdn.jkdesu.com/assets/images/animes/image/dragon-ball-z-movie-13-wrath-of-the-dragon.jpg','En la ciudad de Satán, Son Gohan y Videl salvan de la muerte a un extraño anciano. Este les obsequia con un cofre en el que asegura, se halla encerrado un viejo héroe del planeta Konatzu. Gohan y Videl reúnen las 7 bolas mágicas con las que abren el cofre mágico. De su interior, además de Tapion, surge una terrible criatura llamada Hirudegan. Este monstruo, vencido por Tapion, necesita encontrar su otra mitad para recuperar toda su fuerza y transformarse en un ser invencible. Para evitar que esto suceda, nuestros amigos inician una apasionante aventura... Sólo una fuerza inmensa puede vencer al enemigo más poderoso contra el que se han enfrentado jamás...');
