INSERT INTO animes (nombre,foto,descripcion) VALUES ('digimon adventure 02','https://cdn.jkdesu.com/assets/images/animes/image/digimon-adventure-02.jpg','Es la secuela de Digimon Adventure, han pasado tres años desde que volvieron desde el digiworld cuando T.K. y Kari son llevados de vuelta junto a otros tres nuevos niños elegidos, que consiguen sus digimon cada uno. Despues, consiguen los llamados digieggs que les permite digievoluciones especiales y se enfrentan al emperador un niño elegido que intenta apoderarse de todo el digimundo.');
