INSERT INTO animes (nombre,foto,descripcion) VALUES ('2x2 shinobuden','https://cdn.jkdesu.com/assets/images/animes/image/2x2-shinobuden.jpg','Shinobu es una aprendiz de Ninja, tratando de pasar su examen de aceptación dentro de la escuela de Onsokumaru. Kaede es solo una chica escolar comun y corriente, que estudia para su examen de la escuela. Sus caminos se encuentran cuando Shinobu trata de robar de la habitacion de Kaede sus braguitas, como parte del examen que se le aplica. La capacidad de Shinobu como ninja es pésima, por lo que Kaede se da cuenta de que trata de robar sus pantys y la detiene. Shinobu entonces, comienza a llorar por el fracaso que es su vida y Kaede decide dejar que Shinobu se lleve un par de pantys y asi ayudarla a superar el examen. De aquí nace una amistad entre las dos chicas, que lleva a que Shinobu lleve a Kaede a la escuala Ninja, y ésta se dará cuenta que más que enseñar a Shinobu lo que hacen es aprovecharse de ella. Entre otras cosas porque tanto Onsokumaru, como todos sus secuaces, no hacen más que cosas obscenas y totalmente subrrealistas.');
