INSERT INTO animes (nombre,foto,descripcion) VALUES ('tenkuu no escaflowne','https://cdn.jkdesu.com/assets/images/animes/image/tenkuu-no-escaflowne.jpg','Estudiante de secundaria Hitomi es transportado desde la Tierra al magico mundo de Gaea, donde conoce a chico principe Van Fanel, y esta atrapada en su intento de unir a los paises de Gaea contra el imperio Zaibach ominosa. En el camino, ella descubre una habilidad oculta y se esfuerza por desentrañar las capas de misterio que rodean Van, su pasado, y la máquina gigante conocida como Escaflowne');
