INSERT INTO animes (nombre,foto,descripcion) VALUES ('full metal panic','https://cdn.jkdesu.com/assets/images/animes/image/full-metal-panic.jpg','La historia comienza cuando Mithril, una organización de mercenarios que existe para mantener la paz mundial, se entera que una estudiante japonesa de nombre Kaname Chidori es el próximo blanco de la KGB (una de tantas organizaciones terroristas que la quieren capturar), ya que la han identificado como una posible "whispered". Entonces mandan un escudaron para protegerla, siendo el más competente Sagara Sousuke. Es entonces cuando la historia se torna cómica cuando el joven soldado Sagara interactúa con gente civil y normal, claro sin olvidarse de la trama y los enfrentamientos que suceden entre Mithril y sus misteriosos enemigos.');
