INSERT INTO animes (nombre,foto,descripcion) VALUES ('ergo proxy','https://cdn.jkdesu.com/assets/images/animes/image/ergo-proxy.jpg','La historia comienza en una ciudad llamada Romdo en la cual habitan humanos y unos robots denominados “Autoraves”,  pero luego ocurren una serie de asesinatos causados por Autoraves infectados con un virus denominado “Cogito”, el cual dota de emociones a los robots. “Vincent” un inmigrante encargado de eliminar autoraves infectados se ve involucrado con uno llamado “PINO”  la cual es acusada de causar la infección en la ciudad. Mediante las investigaciones “Lil Mayer” llega a Vincent del cual se desconoce su pasado, mientras tanto Vincent y pino son expulsados de romdo , Lil comienza a dudar sobre las leyes de la ciudad y decide ir a buscarlo lo que la lleva a comenzar un viaje lleno de secretos y situaciones inesperadas junto a Vincent y pino por el mundo en busca del pasado de Vincent, donde descubrirán a un mundo debastado pero con vida y a unos humanoides denominados Proxys que pueden ser la salvación del mundo.');
