INSERT INTO animes (nombre,foto,descripcion) VALUES ('utawarerumono','https://cdn.jkdesu.com/assets/images/animes/image/utawarerumono.jpg','Utawarerumono es una historia post-apocalíptica centrada en el protagonista enmascarado, Hakuoro, que es encontrado por una familia de dos muchachas y una abuela en un busque cerca de su pueblo. Al recuperarse, y ser interrogado, se descubre que tiene amnesia, desconociendo todo su pasado, incluyendo su nombre - siendo Hakuoro el nombre dado por la familia que lo acogió. Hakuoro pronto es aceptado en la aldea y viviendo con ellas, pero después de poco tiempo Hakuoro encuentra que la vida en esta aldea está siendo oprimida por el emperador. Luego de armar de valor a toda la aldea, hakuoro llegará a tomar el poder del gobierno.');
