INSERT INTO animes (nombre,foto,descripcion) VALUES ('fatestay night','https://cdn.jkdesu.com/assets/images/animes/image/fatestay-night.jpg','Cada 10 años se lleva acabo un ritual, una guerra entre 7 magos escogidos por una fuerza omnipotente, cuyo objetivo es invocar el "Santo Grial" y que este le conceda al vencedor un unico deseo que sera realizado sin importar lo que se pida. Para luchar los magos seran provistos de un Sirviente (Servant) que es un Espiritu Heroico (Espiritus que en vida fueron grandes Heroes) invocado unicamentre gracias al poder del Santo Grial. Shiro Emiya fue salvado de un inmenso incendio 10 años atras por un mago llamado Kiritsugi Emiya, posee muy poco talento para la magia pero se ve involucrado en la nueva guerra y su servant es invocado de manera poco convencional, confundido, decide participar de la lucha con la determiancion de detener esta locura como de lugar, su servant es abrumadora, elegante y muy noble, se enamora inevitablemente, durante las luchas el determinara el destino de esta especial mujer.');
