INSERT INTO animes (nombre,foto,descripcion) VALUES ('hungry heart','https://cdn.jkdesu.com/assets/images/animes/image/hungry-heart.jpg','Kyosuke es un muchacho de 16 años en su primer año en el instituto Jyoyo Akanegoaka. Antes de llegar, solía jugar al fútbol, pero decidió abandonarlo por ciertas razones... Sin embargo, en su primer año de instituto, se convierte por accidente en el entrenador de un equipo femenino de fútbol y descubre que el fútbol le sigue encantando. Kyosuke se une finalmente al equipo de fútbol y conseguirá, con las atractivas compañeras de equipo y rivales, llegar a ser uno de los mejores futbolistas del mundo.  Esta serie de TV es un drama lleno de emocionantes partidos de fútbol, amistad y enternecedoras historias, basado en Hungry Heart de Yoichi Takahashi, el autor de Capitán Tsubasa (Campeones).');
