INSERT INTO animes (nombre,foto,descripcion) VALUES ('dna ova','https://cdn.jkdesu.com/assets/images/animes/image/dna-ova.jpg','La nieta de Junta regresa en el tiempo con el fin de hacer a Junta el megaplayboy para que pueda seguir con su existencia. Con ella, también viaja un anciano con la intención de convertirlo en lo que su destino lo deparará para siempre, que son los propósitos principales de este anciano. Cuando empieza a ser atacado, Junta no tiene alternativa, y finalmente, tienen que convertirse en el megaplayboy para poder proteger a sus seres queridos. ');
