INSERT INTO animes (nombre,foto,descripcion) VALUES ('school rumble','https://cdn.jkdesu.com/assets/images/animes/image/school-rumble.jpg','Tenma Tsukamoto es una estudiante que, como tantas otras, está perdidamente enamorada. El afortunado es Ooji Karasuma, un muchacho inexpresivo e indiferente a todo, por lo que se verá obligada a enamorarle por todos los medios. Lo que Tenma ignora es que todo un “Rey del Barrio”, Kenji Harima, anda detrás de ella y, pese a su fuerza y valor, es incapaz de mostrarle sus sentimientos.   Las amigas de Tenma son una luchadora, una millonaria y una mujer muy misteriosa. Su hermana menor, Yakumo Tsukamoto, también será relevante. Los demás personajes son capaces de hacer cualquier cosa por amor... o por lo que haga falta.');
