INSERT INTO animes (nombre,foto,descripcion) VALUES ('tokko','https://cdn.jkdesu.com/assets/images/animes/image/tokko.jpg','Ranmaru Shindô es un investigador de Tokki (División de las Tropas Móviles Especiales de Investigación), grupo al que se une para investigar un sangriento caso que aconteció en un complejo de departamentos ubicado en Machida en los que murieron casi todos sus ocupantes incluyendo a sus padres, razón por lo cual jura cobrar venganza. Al pasar un tiempo comienza a pensar que nada logrará, pero un dia conoce a una mujer misteriosa que ha visto en sus sueños, la chica trabaja en la Sección 2 de Tokki mejor conocida como Tokko, ella al darse cuenta que Shindô es especial lo integra a la Sección 2, momento en que su vida dará un cambio total.');
