INSERT INTO animes (nombre,foto,descripcion) VALUES ('saint seiya tenkai hen','https://cdn.jkdesu.com/assets/images/animes/image/saint-seiya-tenkai-hen.jpg','Después de la batalla con Hades, Seiya se encuentra en un estado cercano a la muerte, y Saori se encarga de cuidarlo en una casa cerca del Santuario. Mientras Seiya se recupera, tres guerreros celestiales son enviados por Artemisa, diosa de la Luna y hermana mayor de Atenea, con la intención de acabar con Seiya.Saori, para evitar la muerte de Seiya, llega a un acuerdo con Artemisa: Atenea entregará su báculo sagrado, renunciando a todos sus derechos sobre el Santuario y perdiendo así, todos sus poderes, a cambio de que le perdonen la vida a Seiya.El objetivo de Artemisa es acabar con la humanidad por haberse corrompido a lo largo del tiempo y olvidarse de los dioses. Saori al darse cuenta de su error, anteponer la vida de Seiya al bienestar de la humanidad, se dirige a la fuente de la redención para expiar su pecado.Al no sentir la presencia de Saori, Seiya reacciona y es capaz de recuperarse rápidamente. ');
