INSERT INTO animes (nombre,foto,descripcion) VALUES ('capitan tsubasa','https://cdn.jkdesu.com/assets/images/animes/image/capitan-tsubasa.jpg','Tsubasa Osora (Oliver Atom) es un joven con grandes ambiciones en el mundo futbolistico, su mas grande meta es jugar en la copa del mundo con su selección para eso debera afrontar numerosos retos junto con sus amigos Genzo Wakabaihashi (Benji Price), Mizaki(Tom), Hyuga(Stiff)entre otros, vivira todas las alegrias y tristesas de un jugador de futbol profecional en su camino para convertirse en el mejor.');
