INSERT INTO animes (nombre,foto,descripcion) VALUES ('escaflowne','https://cdn.jkdesu.com/assets/images/animes/image/escaflowne.jpg','SINOPSIS: Hitomi es una joven estudiante japonesa que se encuentra sumida en un estado de depresión y desea desaparecer. Sorprendentemente, su deseo se cumple y se ve transportada mágicamente al mundo de Gaia. Allí encuentra a Van, un joven rey que ha jurado venganza contra las fuerzas invasoras del Dragón Negro, que arrasaron su reino y amenazan con conquistar y dominar todo el planeta. Atrapada en un conflicto que ni siente ni comprende, Hitomi decide ayudar a Van en su cruzada y acaba descubriendo que ella misma es una pieza clave en el destino de Gaia. ');
