INSERT INTO animes (nombre,foto,descripcion) VALUES ('shin tenchi muyo','https://cdn.jkdesu.com/assets/images/animes/image/shin-tenchi-muyo.jpg','Tenchi decide mudarse a Tokyo para lidiar con una vida normal en la gran ciudad. Una vez en Tokyo, Tenchi conoce a una chica llamada Sakuya. Pronto se enamoran, pero resulta que una siniestra fuerza oscura ha creado a Sakuya para atrapar a Tenchi y dominar la Tierra. Ahora Tenchi debe balancear el amor, la amistad, y la vida mientras defiende a la Tierra una vez más. ');
