INSERT INTO animes (nombre,foto,descripcion) VALUES ('iketeru futari','https://cdn.jkdesu.com/assets/images/animes/image/iketeru-futari.jpg','Saji Keisuke es un muchacho de 16 años, que fantasea con las mujeres, en especial con Akira Koizumi, objeto de su amor. Sin embargo Koizumi odia a Saji (al igual que a otros hombres), al punto de pegarle. Aun así Saji no se rendirá en su objetivo principal, cortejar a Koizumi y que sea su novia.');
