INSERT INTO animes (nombre,foto,descripcion) VALUES ('suzumiya haruhi no yuuutsu','https://cdn.jkdesu.com/assets/images/animes/image/suzumiya-haruhi-no-yuuutsu.jpg','Trata de la vida de la estudiante de secundaria superior Haruhi Suzumiya y de aquellos que quedan atrapados en sus locuras. Aunque Haruhi es el personaje central, la historia es contada desde el punto de vista de Kyon, uno de sus compañeros de clase.  Kyon es un estudiante de secundaria superior que recientemente ha dejado atrás sus fantasías de sucesos paranormales, viajeros del tiempo, y aliens, junto con la escuela secundaria inferior. Sin embargo, cuando elige hablar con una chica excéntrica que responde al nombre de Haruhi Suzumiya el primer día de clase, inintencionalmente desata una cadena de eventos que lo llevan a situaciones enteramente diferentes del mundo real.');
