INSERT INTO animes (nombre,foto,descripcion) VALUES ('saikano','https://cdn.jkdesu.com/assets/images/animes/image/saikano.jpg','Shise y Shuji, dos jovenes estudiantes deciden darse una oportunidad a su relación. Sin embargo, Japón esta en guerra y en un ataque a Saporo, Shuji se da cuenta que la joven que es su novia es una mortal arma de destrucción militar creada por la milicia. Es así como Shuji descubre el secreto de Shise, y decide estar con ella hasta el final de las consecuencias, en medio de la guerra y solo contando con el amor.');
