INSERT INTO animes (nombre,foto,descripcion) VALUES ('king of fighters another day','https://cdn.jkdesu.com/assets/images/animes/image/king-of-fighters-another-day.jpg','En una ciudad donde se alojaban algunos de los luchadores de King of Fighters se producía un gran incendio el cual se creía que fue creado por un clon del personaje Kyo. Los luchadores decidieron ayudar con el problema pero algunos enemigos se oponían a eso, pero los King of Fighters no dejaron todo como los criminales querían, sino que se opusieron y crearon una gran batalla.');
