INSERT INTO animes (nombre,foto,descripcion) VALUES ('mobile suit gundam seed destiny','https://cdn.jkdesu.com/assets/images/animes/image/mobile-suit-gundam-seed-destiny.jpg','Mobile Suit Gundam SEED Destiny comienza en el año 73 de la Era Cósmica, dos años después de la firma del Tratado de Junius 7, hecho que puso fin a la Guerra de San Valentín Sangriento, relatada en Gundam SEED. Este nuevo escenario presenta a Cagalli Yula Athha acompañada de su guardaespaldas Alex Dino asistiendo a una reunión diplomática con el máximo representante de PLANT, Gilbert Durandal. Durante este encuentro, uno de los hangares de la base militar de PLANT es asaltado por un grupo de fuerzas especiales de la Alianza Terrestre llamado "Phantom Pain". Esto empuja a Durandal a declarar el estado de alerta y ordenar el despegue del crucero Minerva, con un grupo de pilotos de élite formado por Shinn Asuka, Lunamaria Hawke y Rey Za Burrel, con órdenes de recuperar los Mobile Suits capturados. ');
