INSERT INTO animes (nombre,foto,descripcion) VALUES ('samurais warrios','https://cdn.jkdesu.com/assets/images/animes/image/ronin-warriors.jpg','Talpa, el señor demonio del Netherworld, está empeñado en conquistar el mundo mortal. Junto con sus cuatro señores oscuros de la guerra son los cinco samurais, cada uno en posesión de armas y armaduras místicas. Son asistidos por Mia Koji, un joven estudiante-profesor, y un misterioso monje-guerrero conocido sólo como El Anciano.');
