INSERT INTO animes (nombre,foto,descripcion) VALUES ('buzzer beater','https://cdn.jkdesu.com/assets/images/animes/image/buzzer-beater.jpg','Hideyoshi-kub (Tono) es un chico que se a criado en la calle, quien para poder sobrevivir usa el basketball para ganar algo de dinero. La tierra actualmente pasa por un mal momento ya que el mundo del baloncesto es dominado por extraterrestre quienes poseen una gran fuerza y asombrosa habilidad.Es por eso que Yoshimune el fundador de la Liga Intergalactica, creada por los seres humano pero dominada por extraterrestre siente una gran impotencia por lo que decide  reunir los mejores jugadores del mundo para derrotar la Liga Intergalactica y de volver la dignidad a los seres humanos. Luego de reunir el equipo antes de enfrentarse a la liga deben derrotar otros equipos de extraterrestre que están por debajo de la Liga y así comienza toda  una travesía...');
