INSERT INTO animes (nombre,foto,descripcion) VALUES ('onegai twins','https://cdn.jkdesu.com/assets/images/animes/image/onegai-twins.jpg','Esta historia trata sobre tres jóvenes huérfanos lo cuales viven vidas totalmente diferentes y distantes, ellos al ver las noticias por casualidad se enteran de que el lugar donde se transmite esa información es la casa donde vivieron alguna vez cuando eran bebes; pueden saber esto ya que cada uno contiene una foto de su infancia. Kamishiro Mike, Miyafuji Mina y Onoreda Karen se dirigen hacia esa casa pero se encuentran con una sorpresa ya que en la foto solo hay dos bebés y ellos son tres. Quién de ellos está equivocado y no estaba en la foto cuando fué tomada. En lo que lo averiguan los tres tratarán de vivir en la casa de sus recuerdos intentando ser una familia pero jaja dos chicas y un chico viviendo solos en una casa....muchas cosas sucederán.');
