INSERT INTO animes (nombre,foto,descripcion) VALUES ('fullmetal alchemist the conqueror of shamballa','https://cdn.jkdesu.com/assets/images/animes/image/fullmetal-alchemist-the-conqueror-of-shamballa.jpg','Dos años han pasado desde que Edward se sacrificara para poder resucitar a su hermano Alphonse y que llegara nuestro mundo. Hasta entonces, Edward a estado intentando volver a su mundo estudiando sobre cohetes y el viaje al espacio, creyendo que así volverá a su mundo. Mientras, Alphonse viaja por su mundo buscando la manera de poder recuperar a su hermano. Lo que ellos no saben, es que una organización oculta prepara un plan que podría poner en peligro ambos mundos. ');
