INSERT INTO animes (nombre,foto,descripcion) VALUES ('initial d fourth stage','https://cdn.jkdesu.com/assets/images/animes/image/initial-d-fourth-stage.jpg','A pasado mucho tiempo desde que Takumi decidio meterse en el mundo de las carreras Callejeras, durante esta temporada el es invitado por Ryosuke Takahashi para conformar un equipo inbatible que rompa e imponga todas las marcas ademas de competir contra otros equipos. Todo esto antes de que se reciba en medicina y comienze a trabajar en el hospital de su padre, cosa que le conllevaria a dejar las carreras.');
