INSERT INTO animes (nombre,foto,descripcion) VALUES ('green green','https://cdn.jkdesu.com/assets/images/animes/image/green-green.jpg','En la escuela ""Kanenone Gakuen"" solo estudian chicos donde acogen a un grupo de chicas provenientes de otro instituto durante el verano, a modo de prueba para ver si ""Kanenone"" puede volverse más adelante una escuela mixta. Sin embargo, los chicos de la misma lo ven únicamente como una oportunidad para tener relaciones sexuales.  En cuanto llegan las chicas a la escuela y se abren las puertas del autobús en el que venían, aparece de la nada una chica llamada Midori, quien al ver a Yuusuke se lanza sobre el.');
