INSERT INTO animes (nombre,foto,descripcion) VALUES ('rurouni kenshin seisouhen','https://cdn.jkdesu.com/assets/images/animes/image/rurouni-kenshin-seisouhen.jpg','"Seisouhen" puede traducirse más o menos como "los años que han pasado". La historia tiene su punto de partida después de varios años desde que Kenshin decidió no esgrimir más su espada y decidió no volver a luchar. Otros personajes conocidos toman parte en esta parte, como Yahiko, que ha crecido hasta convertirse en un adulto. Kenshin y Kaoru se han casado y tienen un hijo llamado Kenji.  La conclusión de la historia de Kenshin, en la cual acosado por una grave enfermedad, toma la desición de dejar su familia para ir en una misión para redimirse de sus pecados como asesino.');
