INSERT INTO animes (nombre,foto,descripcion) VALUES ('excel saga','https://cdn.jkdesu.com/assets/images/animes/image/excel-saga.jpg','Excel Saga trata acerca de las desventuras de la organización secreta ideológica ACROSS, de quién hace parte la hiperactiva Excel, quién no quiere hacer nada más que complacer a su señor, Lord Ilpalazzo, el cuál quiere dominar el mundo. Las desventuras de Excel y de su compañera Hyatt, quién muere constantemente, las llevan a hacer todo tipo de impertinencias. Todo en este mundo es parodiado y bizarro, incluso hasta el mismo director.');
