INSERT INTO animes (nombre,foto,descripcion) VALUES ('golden boy','https://cdn.jkdesu.com/assets/images/animes/image/golden-boy.jpg','Golden Boy es una serie de anime que consta de 6 episodios, en los cuales se narran las aventuras de Kintaro Oe, un joven estudiante de derecho de 25 años que ha dejado la carrera porque ya ha aprendido todo lo que necesitaba de ella, y ahora recorre Japón en bicicleta, buscando nuevos trabajos que le ofrezcan cosas nuevas para aprender. Se encuentra basado en un manga de igual nombre por Tatsuya Egawa, fue publicado en la revista Super Jump y fue compilado en 10 volúmenes.  La serie fue producida por KSS Shueisha en 1995.');
