INSERT INTO animes (nombre,foto,descripcion) VALUES ('dragon ball z movie 09 bojack unbound','https://cdn.jkdesu.com/assets/images/animes/image/dragon-ball-z-movie-09-bojack-unbound.jpg','Un misterioso torneo de las artes marciales llama la atencion de los guerreros z, al cual deciden entrar. Krillin, Trunks y Gohan pasan a las semifimales, en donde tendrian que enfrentarse contra los dicipulos de Satan, pero algo extraño sucede. Al comenzar cada batalla, los guerreros z se daran cuenta de que los cuatro peleadores rivales no son peleadores normales de este planeta y que son extremadamente fuertes. Asi Vegeta y Piccolo llegaran para ayudar, pero queda en duda si podran ganar esta vez, cuando conozcan el verdadero poder de uno de los enemigos, Boujack');
