INSERT INTO animes (nombre,foto,descripcion) VALUES ('ghost stories','https://cdn.jkdesu.com/assets/images/animes/image/ghost-stories.jpg','Cuando la madre de Clare muere, ella, su padre y pequeño hermano, se mudan a la ciudad en la cual se crió su madre. Allí ella estudiara  en la misma escuela a la que acudió su madre cuando era niña (la escuela nueva, por que su madre fue a la vieja escuela). Lo que Clare no sabe es que, su familia materna posee una habilidad especial la de luchar contra fantasmas y detener a los fantasmas malignos, habilidad que ella heredó. Por desgracia, al morir la madre de Clare, un árbol sagrado en el que la madre de Clare había encerrado a los fantasmas es tirado, así los fantasmas que antes su madre había capturado son liberados gracias a el poder psíquico de Clare; al darse cuenta de esto, la protagonista busca consejo de su madre a través de un diario que ella llevaba a la escuela y descubre que, donde antes habia paginas en blanco, ahora había informacion escrita sobre todos y cada uno de los espectros con los que se enfrentara en el transcurso de la serie.');
