INSERT INTO animes (nombre,foto,descripcion) VALUES ('zatch bell','https://cdn.jkdesu.com/assets/images/animes/image/zatch-bell.jpg','Kiyomaro Takamine es un chico de 14 años muy hábil y inteligente, un día recibe un regalo de su padre un niño llamado Gash Bell quien perdió la memoria y lleva consigo un libro rojo, muy pronto Kiyomaro descubrirá que Gash pertenece al mundo Mamodo y que fue enviado junto a otros 100 niños Mamodo para decidir el próximo rey. Así comienza la aventura donde Kiyomaro tendrá que ayudar a Gash a recobrar su memoria y ganar la batalla para convertirse en un Rey bondadoso.');
