INSERT INTO animes (nombre,foto,descripcion) VALUES ('naruto akaki yotsuba no clover wo sagase','https://cdn.jkdesu.com/assets/images/animes/image/naruto-akaki-yotsuba-no-clover-wo-sagase.jpg','Cuando Konohamaru Sarutobi le pide ayuda a Naruto Uzumaki, este ultimo acepta unirse a su joven amigo en una misión especial: la recuperación del legendario trébol carmesí de cuatro hojas, del que se rumorea que tiene la capacidad de conceder cualquier deseo. La planta milagrosa es aparentemente la única esperanza de Konohamaru para evitar la partida de su amada Kaede Yoshino, quien debe dejar Konoha debido al trabajo de su padre. A pesar de que el trébol único se encuentra en un área prohibida, nada impide que los dos se embarquen valientemente en una peligrosa aventura para lograr su objetivo.');
