INSERT INTO animes (nombre,foto,descripcion) VALUES ('tekkaman blade','https://cdn.jkdesu.com/assets/images/animes/image/tekkaman-blade.jpg','Tekkaman Blade ocurre en el año 2300 D.C. La tierra fue invadida por unas extrañas plantas venenosas que han diezmado la población humana hasta el punto de casi extinguirla. Un día cae del espacio un meteorito y del cráter que provoca sale un chico con amnesia que llama a los alienígenas "Radam". Momentos después los Radam comienzan a invadir la Tierra. Por qué el chico conoce a los alienígenas y de donde ha obtenido los poderes con los que los combate.');
