INSERT INTO animes (nombre,foto,descripcion) VALUES ('samurai champloo','https://cdn.jkdesu.com/assets/images/animes/image/samurai-champloo.jpg','Tres desconocidos con personalidades completamente diferentes se ven reunidos por una pelea en un bar, Fuu, graciosa chica, mesera del bar, Mugen, un vagabundo buscapleitos, experto en el arte de matar con espadas, fuerte como un lobo salvaje y Jin, un diestro espadachin, educado, silencioso y mortal. Fuu, resentida, desea conocer a su padre, pero la unica pista para encontrarlo es que debe buscar al samurai que huele a girasoles. Con un As bajo la manga, Fuu logra conciliar a los 2 guerreros bajo una promesa; "antes de luchar entre ellos, deberan acompañarla hasta encontrar a su padre" y asi inician un viaje lleno de sorpresas, humor, peligro y conspiraciones, donde se llegan crear lazos de compañerismo y amistad.');
