INSERT INTO animes (nombre,foto,descripcion) VALUES ('da capo','https://cdn.jkdesu.com/assets/images/animes/image/da-capo.jpg','El protagonista de la historia, Jun''Ichi Asakura, que va a la Academia Kazami, tiene el poder de ver los sueños de los demás cuando duerme. Además, aprendió la magia que le enseñó su abuela, que le permite crear dulces.  Un día, Jun''Ichi parece haber visto los sueños de otra persona cuando dormía. En ese sueño, una niña de su propia infancia apareció. Pero su hermana Nemu lo despierta, haciéndolo volver de golpe a la realidad. Aunque no son realmente hermanos (ella es adoptada) tienen una vínculo muy fuerte, tanto que a veces da la impresión de que fueran amantes.');
