INSERT INTO animes (nombre,foto,descripcion) VALUES ('tenchi muyo','https://cdn.jkdesu.com/assets/images/animes/image/tenchi-muyo.jpg','Tenchi Masaki es un adolescente del campo de 17 años quien un día se topa con Ryoko, una famosa pirata espacial que está huyendo la policía espacial tras un accidente. Haciéndole creer que ella es la victima, logra quedarse con la familia Masaki.   Muchas chicas llegan de diferentes partes de la galaxia para formar parte de alguna forma de la vida de Tenchi, Aeaaka, la princesa del planeta Jurai; Mitoshi y Kiyone, un par de detectives espaciales... a todas ellas hay que sumarles científicos locos, aliens e importantes enemigos e innumerables aventuras. ');
