INSERT INTO animes (nombre,foto,descripcion) VALUES ('samurai deeper kyo','https://cdn.jkdesu.com/assets/images/animes/image/samurai-deeper-kyo.jpg','Samurai Deeper Kyo sinopsis: Kyoshiro Mibu es un vendedor ambulante de medicinas que lleva una gran katana y, en su espalda, un símbolo del yin-yang. Esto hace confundir a Yuya, una chica cazarrecompensas, que piensa que Kyoshiro en realidad es Kyo Ojos de Ogro, un hombre que había matado a mil hombres y por el que se ofrece una gran recompensa. Pronto Yuya descubrirá que Kyoshiro, en algunas situaciones, deja lugar a otra personalidad: el famoso Kyo Ojos de Ogro, despiadado, frío y temible, totalmente opuesto a Kyoshiro. Después de descubrir esto, Yuya y Kyoshiro seguirán viajando juntos por razones distintas y en su camino vivirán diferentes aventuras y se encontrarán con curiosos personajes.');
