INSERT INTO animes (nombre,foto,descripcion) VALUES ('gantz','https://cdn.jkdesu.com/assets/images/animes/image/gantz.jpg','Kurono es un chico normal , estudiante de secundaria , que en un mundo egoísta , tan solo se preocupa de si mismo. Sin embargo se ve obligado a ayudar a Kato Masaru , amigo suyo de la infancia, que pretendía salvar a un vagabundo caído en las vías del tren. Kurono y Kato consiguen salvar al vagabundo, pero no sus vidas y son arrollados por el tren. Cuando parece que sus vidas han acabado aparecen en una extraña sala con una esfera negra, llamada GANTZ, en la que encontraran armas y trajes, si quieren volver a casa y seguir vivos deberán participar en un "juego" de peligro y horror sin precedentes.');
