INSERT INTO animes (nombre,foto,descripcion) VALUES ('hunter x hunter greed island final','https://cdn.jkdesu.com/assets/images/animes/image/hunter-x-hunter-greed-island-final.jpg','Greed Island Final es la tercera y hasta ahora ultima serie de OVAs de la serie Hunter X Hunter. Esta comienza con Gon Y Killua ya dentro del juego Greed Island ("Isla de la ambición"), entrenándose en el NEN con Biscuit, a quien conocieron en el OVA anterior. A medida que el trío se va adentrando en el juego, descubren que es mas difícil y peligroso de lo que parece, en especial el grupo que se hace llamar "Los bombarderos". Sin embargo, Gon esta decidido a no dejar pasar esta oportunidad de encontrar una pista de su padre.');
