INSERT INTO animes (nombre,foto,descripcion) VALUES ('genshiken','https://cdn.jkdesu.com/assets/images/animes/image/genshiken.jpg','Esta historia gira en torna a un grupo de jóvenes universitarios japoneses afiliados a un club llamado "Sociedad por el estudio de la cultura visual moderna" (現代視覚文化研究会, Gendai shikaku bunka kenkyūkai), aunque el nombre suena complicado, la actividad del club se centra en actividades otakus como el estudio y análisis de animes. Este club sufre la falta de miembros y eventos para realizar, y la discriminación del grupo de manga, entre otros. La historia toma fuerza con la llegada de nuevos miembros, entre los cuales están un chico que encaja perfectamente en el estereotipo de un otaku, un chico, que a la inversa, nunca encajaría en este estereotipo por su apariencia física (es guapo, viste a la moda y tiene mucho éxito con las chicas), una chica hasta cierto punto "normal" y si se puede decir frívola, y finalmente una chica que, recién llegada de América, es aficionada al cosplay.');
